    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Quel est le rôle du biseau d'une flûte ? Comment se constitue le \" timbre \" d'un instrument, qui nous permet de distinguer à coup sûr une trompette d'une clarinette ? A travers de nombreux exemples illustrés, cet ouvrage présente les bases nécessaires pour comprendre les phénomènes complexes à l'œuvre dans les instruments de musique. Il s'adresse aux chercheurs, aux étudiants - des exercices corrigés en ligne leur sont proposés - et aux ingénieurs, mais aussi aux musiciens, facteurs et mélomanes qui souhaitent acquérir les fondements de l'acoustique musicale. Détaillant les résultats considérables acquis ces quinze dernières années, les auteurs s'appuient sur l'analyse progressive des briques élémentaires participant à la production du son pour dégager des concepts applicables à l'ensemble des instruments. Ils montrent en particulier que des modèles physiques, même simples, peuvent être mis à profit pour des applications concrètes en facture instrumentale, en prise de son ou en synthèse sonore. [Source : d'après la 4e de couverture]",
