    "Summary": "\"\"Implicitement, j'avais analysé et mémorisé les deux premiers mouvements de la manière suivante : le bras forme une ligne droite qui décrit un arc de cercle vers le bas ; au moment précis où il passe devant le genou, celui-ci se fléchit, puis le tronc bascule d'environ 20 vers l'avant, etc. Il était impossible d'exécuter correctement la phrase de Set and Reset avec cette lecture du mouvement. La suivante fonctionnait mieux : je laisse tomber le poids du bras étendu, le bras entraîne dans sa chute le genou dont le fléchissement fait basculer le torse, et ainsi de suite.\" Danseur et chorégraphe, Noé Soulier articule ici des manières de prêter attention au mouvement en s'appuyant sur une analyse des pratiques chorégraphiques. Il développe ainsi des focales d'attention: des cadrages conceptuels qui proposent différentes façons d'appréhender k mouvement et k corps. Cette recherche se situe à la frontière ténue entre une pratique artistique qui se concentre sur l'attitude du spectateur et une réflexion sur l'art qui cherche moins à décrypter le sens des oeuvres qu'à enrichir les multiples manières d'en faire l'expérience. Actions, mouvements et gestes est une proposition chorégraphique qui prend la forme d'un livre. C'est une oeuvre d'observation qui fait de l'élaboration de différents modes de regard sur le mouvement la danse elle-même.\"--Page 4 of cover.",
