    "Original Year Published": "",
    "Edition": "",
    "Genre": "Human mechanics",
    "Summary": "Ce livre a été réalisé pour que l'anatomie ne soit plus un domaine réservé aux seuls spécialistes, mais intéresse le plus grand nombre, et en particulier celles et ceux qui pratiquent une technique corporelle. Il présente d'une manière vivante, un panorama des os, des articulations, des muscles, en liaison directe avec le mouvement. Il s'appuie essentiellement sur l'illustration \"en volume\". Celle-ci est commentée par un texte qui peut être abordé en deux temps : lecture rapide ou plus approfondie. Une édition entièrement renouvelée : En 1981, Blandine Calais-Germain fondait l'anatomie pour le mouvement). En 1984, après trois ans d'élaboration, elle éditait cet ouvrage : \"anatomie pour le mouvement\" tome 1. Quinze années se sont écoulées, et l'œuvre de Blandine Calais-Germain s'est développée, affinée, en particulier grâce à un travail permanent de recherche et d'enseignement. La nouvelle édition est le fruit de cette évolution. L'ouvrage a été entièrement revu par son auteur et enrichi d'apports nouveaux. Plus de 700 dessins d'anatomie ont été retravaillés ou changés. Le vocabulaire anatomique international est ajouté et l'innervation des muscles précisée.",
