    "Summary": "Cet ouvrage analyse les mouvements les plus courants rencontrés dans les techniques corporelles et présente un répertoire d'exercices. Les mouvements et les exercices proposés ont été choisis à partir du point de vue anatomique pour leur efficacité et leur innocuité. Ils sont expliqués dans le détail, avec de nombreuses variantes permettant de les adapter aux différentes situations rencontrées en cours. À qui s'adresse-t-il? Aux personnes qui enseignent ou pratiquent une technique corporelle, et qui veulent un éclairage anatomique pour le choix de leurs exercices et progressions.",
