    "Title": "Antispéciste",
    "Original Title": "",
    "Subtitle": "réconcilier l'humain, l'animal, la nature",
    "Series": "",
    "Volume": "",
    "Author": "Aymeric Caron",
    "Author (Last, First)": "Caron, Aymeric",
    "Illustrator": "",
    "Narrator": "",
    "Translator": "",
    "Photographer": "",
    "Editor": "",
    "Publisher": "Don Quichotte éditions",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 2016,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Certains en possèdent déjà : les animaux de compagnie, les espèces protégées et les animaux d'élevage. Mais les droits que nous leur avons consentis sont minimaux et incohérents. Nous traitons différemment les chiens, que nous considérons comme des membres de la famille, et les cochons, réduits au rang d'objets produits en masse et abattus dans d'indignes conditions. Pourtant cochons et chiens présentent une sensibilité et une intelligence similaires. Comment en sommes-nous venus à les classer dans des catégories si différentes ? C'est que nous sommes spécistes. Le terme, peu connu en France, fera bientôt partie de notre vocabulaire. A l'instar du racisme et du sexisme, dont il poursuit la logique. Le spécisme consiste à traiter différemment, et sans la moindre raison valable, deux espèces qui présentent les mêmes caractéristiques. Tout comme nous avons longtemps dénié aux femmes les mêmes droits que les hommes. L'affirmation de l'antispécisme sera celle de l'animalisme, un mouvement philosophique qui promeut la nécessité d'accorder des droits à tous les animaux, en raison de leur capacité à souffrir. Loin d'être anecdotique, l'animalisme incarne le mouvement idéologique le plus révolutionnaire ; pour la première fois depuis 2000 ans, il entend sortir nos systèmes de pensée occidentaux de leur logique anthropocentriste et reconnaître que nous, qui sommes des animaux, avons des obligations morales à l'égard de nos cousins. Surtout, l'animalisme s'inscrit dans une logique d'écologie politique, éloignée de celle incarnée dans les élections. Non plus une écologie superficielle, qui se soucie seulement de préserver les écosystèmes, les ressources et quelques espèces en péril, mais une écologie profonde, qui repense complètement la place de l'homme dans le monde. Pour que ce dernier ne vive plus en parasite, mais en symbiose avec toutes les formes de vivant. Cela oblige à une refonte de nos institutions et à briser la vision à court-terme du temps politique. Cela nous oblige aussi à une réforme intellectuelle qui remette en question la notion de \" profit \". Le capitalisme, le socialisme, le communisme, le néo-libéralisme sont aujourd'hui discrédités, si ce n'est dépassés.",
