    "Summary": "The gold standard of excellence for 25 years, Frank H. Netter, MD's Atlas of Human Anatomy offers unsurpassed depictions of the human body in clear, brilliant detail - all from a clinician's perspective. With its emphasis on anatomic relationships and clinically relevant views, Dr. Netter's work provides a coherent, lasting visual vocabulary for understanding anatomy and how it applies to medicine today. * View anatomy from a clinical perspective with hundreds of exquisite, hand-painted illustrations created by pre-eminent medical illustrator Frank H. Netter, MD. * Join the global community of medical and healthcare students and professionals who rely on Netter to optimize learning and clarify even the most difficult aspects of human anatomy. Comprehensive labeling uses the international anatomic standard terminology, Terminologia Anatomica, and every aspect of the Atlas is reviewed and overseen by clinical anatomy and anatomy education experts. * Explore additional unique perspectives of difficult-to-visualize anatomy through all-new paintings by Dr. Carlos Machado, including breast lymph drainage; the pterygopalantine fossa; the middle ear; the path of the internal carotid artery; and the posterior knee, plus additional new plates on arteries of the limbs and new radiologic images. * Master challenging structures with visual region-by-region coverage -- including Muscle Table appendices at the end of each Section.",
