    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "The Basic Neurocellular Patterns (BNP) form the underlying words and phrases in the language of human movement. The BNP have a global influence on our physical, perceptual, emotional, and cognitive functioning. They shape how we bond, defend, learn, organize, and sequence information, and how we relate to ourselves, others, and the world. The BNP have extensive application in the areas of movement and psychophysical expression. Done in sequences, they can also form the basis for a deep and ongoing personal movement practice. Although the BNP normally emerge and ideally integrate throughout infancy, revisiting these patterns and exploring them as adults can be eye-opening, transformation, and life changing. With this book as a guide, Bonnie invites you to directly experience, embody, and integrate your own developmental movement patterns. In doing so, you can come to know and use this work in deep and meaningful ways with yourself and with others.",
