    "Original Year Published": "",
    "Edition": "",
    "Genre": "Graphic Novels",
    "Summary": "Avec Amarillo, tome 5 de Blacksad, Juan Díaz Canales et Juanjo Guarnido entraînent leurs héros – Blacksad, le chat détective privé – dans un road-movie qui n'est pas sans évoquer la « beat generation »...\n\nCe cinquième épisode de Blacksad, Amarillo, s'ouvre à La Nouvelle-Orléans : Weekly doit quitter la ville ; il y laisse John qui préfère rester sur place pour chercher du travail. Par chance, celui-ci croise justement un riche Texan qui lui propose de ramener sa voiture chez lui : un boulot simple et bien payé ! Le détective accepte, mais, dans une station-service, il se fait voler la voiture par Chad Lowell et Abe Greenberg – deux écrivains beatniks qui cherchent à rejoindre Amarillo, au Texas. Bientôt, une querelle entre les deux hommes, rivaux, vire au drame : Chad, poussé à bout, tire sur Abe qui meurt sur le coup. Obligé de fuir, Chad trouve refuge dans un cirque. John se lance à sa poursuite sur les routes américaines du Nouveau-Mexique, du Colorado, du Texas et de l'Illinois.\n\nAmarillo est le 5e album de Blacksad, une série qui met en scène un chat détective, dans une ambiance qui évoque furieusement le roman noir de la littérature américaine.",
