    "Original Year Published": "",
    "Edition": "",
    "Genre": "Performing Arts",
    "Summary": "MoMA Dance is a new series of monographs exploring dance makers in the twenty-first century. Each volume focuses on a single contemporary choreographer, presenting a rich collection of newly commissioned texts along with a definitive catalogue of the artist's projects. Accessible, informative, and inspiring, they are indispensible guides to contemporary dance for fans and scholars alike. Since shocking audiences in 1993, at age nineteen, with his radically sparse À bras le corps, Boris Charmatz has emerged as one of France's leading choreographers. Whether he's creating a dance composed solely of everyday actions, working with an ensemble of children, or running a \"dancing museum,\" Charmatz's work experiments with the body as a vessel for subjectivity, history, and collective action. Featuring original essays and interviews and an oral history by Charmatz's contemporaries, the book is the first to explore the many facets of his career--as choreographer, writer, and director of France's Musée de la danse.",
