    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Personne ne comprend plus rien à l'Europe, ses traités indigestes, ses crises à répétition. Pour pallier cette incompréhension, Ludovic Lamant a pris l'expression \"construction européenne\" au pied de la lettre et s'est intéressé à ce que l'UE a de plus visible : les bâtiments qui abritent ses institutions. Né des déambulations de l'auteur dans les rues d'une ville qu'il aime, Bruxelles chantiers donne la parole aux architectes et urbanistes qui ont dessiné le quartier européen comme à ceux qui en ont été empêchés, aux eurodéputés et fonctionnaires qui font l'Europe au quotidien et à ceux qui peinent à la réformer. Les quatre voies à sens unique de la rue de la Loi, le corridor de vent de l'esplanade Solidarnosc, l'oeuf encagé du nouveau bâtiment du Conseil : le fatras architectural dépourvu d'éloquence qui balafre la capitale belge laisse entrevoir les renoncements par lesquels un projet politique porteur d'espoir est devenu une machine bureaucratique. Dérive dans les jeunes ruines d'un vieux rêve qui, peut-être, bouge encore.",
