    "Publisher": "Fonds Mercator",
    "Place of Publication": "",
    "Date Published": "2019/10/23",
    "Year Published": 2019,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "La chorégraphe belge Anne Teresa De Keersmaeker s'entretient ici avec la théoricienne du spectacle et musicologue Bojana Cvejic, afin de détailler les principes chorégraphiques de ses quatre premières ouvres (1981-1986). L'analyse rétrospective qui s'élabore au fil des questions permet ainsi de dévoiler les méthodes et les intuitions des années de formation de cette grande artiste de la danse. D'où naissent les premiers mouvements, les premiers gestes d'une chorégraphie ? Comment des structures complexes se dessinent-elles, pour permettre l'invention joyeuse de principes de composition et de styles performatifs inédits ? Anne Teresa De Keersmaeker fait appel à la précision de sa mémoire pour évoquer les motivations et les mille événements qui ont orienté le choix des mouvements, de la musique, de l'éclairage et de l'architecture spatiale dans ces quatre créations. Elle s'efforce de mettre en lumière ce qui guide \"l'organisation des corps et des énergies dans l'espace et le temps\", jetant ainsi les bases de son oeuvre chorégraphique. Cherchant a restituer le riche matériau dont chaque chorégraphie est constituée, Anne Teresa De Keersmaeker et Bojana Cvejic ont ainsi imaginé un ensemble de partitions pour Fase, Rosas danst Rosas, Elena's Aria et le Quatuor a cordes n° 4 de Bartok. Chacune de ces partitions associe un compte rendu détaillé de la chorégraphie, illustré de nombreux dessins, schémas, photographies et documents sur le spectacle, à des demonstrations dansées d'Anne Teresa De Keersmaeker.",
