    "Summary": "\"Alors naît Catharsis. Un livre thérapeutique où Luz nous livre par petites nouvelles ses pensées, son quotidien depuis ce jour qui a bouleversé sa vie, et à une autre échelle, celle de millions d'êtres humains. Les sentiments se bousculent, les styles, le ton. Du rire aux larmes, de la laideur à la beauté, de la colère à l'amour. Catharsis est un ouvrage bouleversant. Y a du Charlie dedans, bien sûr, mais aussi y a du Charb, y a du Cabu, y a du sexe, y a de la musique, y a du Reiser, y a du Feiffer, y a du Franquin, y a la police, y a du rouge, y a l'enfance, y a du rire, y a pas de chanson française, y a du rock, y a du roll, y a des yeux rouges et y a du rire, y a un pigeon, y a de la poésie, y a du Gébé, y a de la pluie, y a du soleil. Y a un auteur qui revit, et un livre incroyable qui s'affirme déjà comme un ouvrage nécessaire. Un classique instantané.\"--Publisher.",
