    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Restituer la parole des ami-e-s de lutte, articuler les \"je\" et \"nous\" d'alors et d'aujourd'hui, faire retour sur des faits et affects peu connus du public français, analyser l'\"épidémie de la représentation\" consécutif à l'apparition du sida : telle est l'entreprise de cet ouvrage, conçu par Elisabeth Lebovici comme un véritable \"discours de la méthode\", où, toujours, le personnel est politique. Engagée aux côtés des activistes français et américains de la lutte contre le sida, observatrice privilégiée, en tant qu'historienne de l'art et journaliste, des débats et enjeux des années 1980 et 1990, l'auteure analyse ce moment charnière des liens entre art et activisme, qu'elle revisite avec sa mémoire de témoin, en survivante affectée. Monographies, entretiens et essais thématiques composent ce volume, rédigé de manière assumée — la seule possible — à la première personne. Il propose ainsi une cosmologie élective — d'ACT UP à Dana Wyse, d'Alain Buffard à Zoe Leonard, de Lionel Soukaz à Mark Morrisroe, entre autres —, illustrée par des archives et ephemera qui soulignent l'importance du graphisme dans la lutte contre le sida. Embrassé par une création originale du collectif lesbien fierce pussy, Ce que le sida m'a fait est un ouvrage nécessaire pour comprendre les \"années sida\", cette période d'une créativité artistique et activiste née de l'urgence de vivre et du combat pour la reconnaissance de tous--tes.",
