    "Summary": "Juin 1862. La Bastide. Bernard-Marie a le spleen de son âge. Pour l'oublier, il se passionne pour le théâtre, la photographie, l'entomologie et la migration des sphynx tête de mort. Mais sa tante Sarah, souffrant du détachement de l'adolescent, tente désespérément d'étouffer ses velléités d'émancipation. Paris. Judith est l'une des attractions principales du Pays des Sphynges, qui compte parmi les bordels les plus courus de la capitale. Sans scrupules, l'orpheline fait de son corps l'outil de son irrésistible ambition : devenir une artiste reconnue et adulée. Sans le savoir, Bernard-Marie rêve de sa mort avec Judith. Sans le connaître, Judith cherche l'âme-soeur, dans l'ombre du miroir sans tain de sa chambre publique. Inconsciemment, malgré la distance et toutes les apparences qui les séparent, leur quête de liberté rend leur rencontre fatale et inéluctable... [4e de couv.]",
