    "Summary": "Comment définir l’identité ? Comment devient-on la mère de sa mère tout en restant sa fille ? Danielle Fournier nous propose trois novellas autour de ces thèmes. Il y a d’abord ce JE, le JE de Grâce, impuissante sur la terre paternelle et témoin de la descente aux enfers de son fils, celui qui joue avec les aiguilles et la mort. Puis ELLE intervient, celle qui pleure la mort de sa mère, qui tente d’accepter l’inacceptable dans une maison peuplée d’ombres. Enfin arrive le NOUS, englobant, neutre, mais vivant malgré tout, sous le signe du silence et de la mélancolie. En toile de fond, l’auteure offre un véritable hymne à la nature, omniprésente : le fleuve, les éléments, le paysage, déclinés poétiquement au gré des saisons.",
