    "Summary": "Reconnues depuis des siècles par de nombreuses traditions comme moyen de guérison naturelle, les propriétés bénéfiques des minéraux ne sont plus à prouver. L'auteur, PIILIP PERMUTT, initié à la médecine traditionnelle taoïste et maître de reiki, dévoile dans le présent ouvrage leurs vertus thérapeutiques. Vous découvrirez ainsi comment lutter contre l'insomnie, les angoisses, le manque de concentration, les troubles émotionnels, les maux de tête, les allergies... Mais aussi comment se protéger des ondes nocives et purifier un lieu. En plus de prévenir et guérir, les cristaux aident à rééquilibrer et harmoniser les énergies physiques et psychiques à l'aide de procédés très simples. Grâce au sérieux et au savoir-faire de son auteur, ce livre permet d'acquérir rapidement différentes méthodes de soin et d'en juger les bienfaits. Avec son répertoire riche de 250 minéraux efficaces contre 250 affections courantes, cet ouvrage deviendra vite un guide précieux et indispensable.",
