    "Original Title": "",
    "Subtitle": "",
    "Series": "",
    "Volume": "",
    "Author": "Rainer Maria Rilke",
    "Author (Last, First)": "Rilke, Rainer Maria",
    "Illustrator": "",
    "Narrator": "",
    "Translator": "",
    "Photographer": "",
    "Editor": "",
    "Publisher": "Editions Marguerite Waknine",
    "Place of Publication": "",
    "Date Published": "2019/05/17",
    "Year Published": 2019,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "C'est l'année 1900. Rilke a vingt-cinq ans. Il vient d'effectuer deux voyages en Russie, le second aux côtés de Lou Andréas Salomé, qui signe aussi la fin de leur histoire d'amour. C'est en août de la même année, sur l'invitation d'un jeune peintre, Heinrich Vogeler, que Rilke décide de rejoindre un groupe d'artistes, à Worpswede, où il rencontrera bientôt Clara Westhoff qui deviendra sa femme et grâce à laquelle surtout il découvrira Auguste Rodin dont elle avait été l'élève. Au cours de cette période essentielle, quelques textes voient le jour, notamment Deux histoires pragroises, les deux premières parties du Livre d'heures, les Histoires du bon Dieu, mais également ce Chant de l'amour et de la mort du cornette Christophe Rilke, où l'on trouve déjà les images et les thèmes essentiels à l'oeuvre de Rilke, à la constitution de sa profonde vie intérieure. Un chant composé au cours d'une nuit d'automne ; un chant splendide et qui résonne comme un écho lointain, à la manière d'une sorte de rêve dont l'allure s'évanouit en parvenant jusqu'au seuil du silence et de la mort. Comme le veut la collection Livrets d'art, le présent ouvrage comprend un cahier dans lequel ont été rassemblées avec soin des images illustrant le texte.",
