    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\"Choreographing Relations\" undertakes the experiment of a conceptual site development of contemporarychoreography by means of practical philosophy. Guided by the radically empiricist question \"What Can Choreography Do?\" the book investigates the performances of Antonia Baehr, Juan Dominguez, Xavier Le Roy, and Eszter Salamon, and the philosophical works of Gilles Deleuze and Félix Guattari. It establishes a relation between these practitioners as an encounter in method, and develops method as a singular,material and experimental practice. In view of these singular methods and the participatory relations to which they give rise, Choreographing Relations offers a prolific inventory of arepresentational procedures that qualitatively transformed choreography and philosophy at the turn of the twentieth century.",
