    "Summary": "A l'ère numérique, le code est au coeur de notre quotidien, il modifie notre rapport au monde et aux autres. \"Coder le monde\" présente un état de la création digitale contemporaine dans différentes disciplines. Revenant sur l'histoire du code numérique et la manière dont les artistes s'en sont emparés depuis l'avènement de l'ordinateur dans les années 1960, ce livre fait apparaître un univers esthétique et critique commun qui questionne notre quotidien entièrement irrigué par les logiques numériques. Les artistes, les musiciens, les écrivains, les architectes, les créateurs de toutes disciplines ont en effet été les prescripteurs et les inventeurs d'une approche alternative du code. Articulé autour de six timelines (Nombres, codes, programmes ; Algoristes ; Littérature ; Architecture, design ; Corps, code ; Musique), cet ouvrage dévoile de multiples correspondances dans les logiques de création et offre une lisibilité globale de ce qui constitue aujourd'hui une culture du numérique.",
