    "Summary": "C’est une maladie étrange qui me vide et qui s’apparente à une gastro-entérite, une maladie chronique dont aucun médecin ne vient à bout. Elle m’empêche de me nourrir correctement et anéantit ma vie depuis 20 ans. Comme disent les médecins, il pourrait s’agir d’une maladie psychosomatique ayant pour origine mon enfance toute en souffrance, ma jeunesse sans allégresse, l’échec de mon mariage ou la réussite de mon divorce ! Cette vie, remplie tour à tour de bonheurs intenses ou de vives déceptions me tordrait les boyaux ? Le psychisme n’étant pas toujours en cause, je cherche ailleurs la vérité. Après l’avoir dénichée sur Internet, je la livre au docteur \"K\" qui n’en fera qu’une bouchée. Ecrit un peu comme un roman, ce combat sur la maladie retrace tous les périples d’une \"colopathe\" qui ne s’en laisse pas compter. Tout en passant au peigne fin les erreurs médicales dont nous sommes victimes, j’encourage les patients à mieux se connaître, afin de collaborer plus étroitement avec leurs médecins.",
