    "Summary": "Ce livre remarquable nous permet d’obtenir une compréhension profonde de la nature et de la fonction de notre esprit, et nous montre comment utiliser cette compréhension pour améliorer notre vie quotidienne.  La première partie est un guide pratique nous permettant de développer et de maintenir un esprit léger et positif, en nous montrant comment reconnaître et abandonner les états d’esprit qui nous font du mal pour les remplacer par des états d’esprit paisibles et bénéfiques.  La deuxième partie décrit en détails les différents types d’esprit, révélant la profondeur de la compréhension bouddhiste de l’esprit. Il se termine par une explication détaillée de la méditation et nous découvrons comment, en contrôlant et transformant notre esprit, nous pouvons parvenir à un état de paix, de joie et de sérénité indépendamment des conditions extérieures.",
