    "Summary": "Ce livre présente, à la manière d'une approche scientifique, les causes de nos difficultés et problèmes quotidiens, et leur solution, en utilisant les enseignements de Bouddha qui nous montrent comment changer le monde en changeant notre esprit. Dans ce monde hyperactif, nos expériences de bonheur ne durent que peu de temps et la paix intérieure nous échappe totalement. Nos états d'esprit négatifs, comme les désirs compulsifs et la colère, sont la cause de problèmes interminables pour nous-mêmes et pour les autres, et nous empêchent de réaliser nos désirs les plus profonds. Guéshé Kelsang commence par nous présenter un des enseignements les plus connus de Bouddha, les quatre nobles vérités, qui offre une solution claire et simple à tous nos problèmes, en nous conduisant à un oasis de paix à l'intérieur de notre cœur. Puis il explique en particulier comment nous pouvons surmonter le problème de la colère, en apprenant à développer et maintenir la patience lorsque nous sommes confrontés à des situations extrêmement difficiles.",
