    "Place of Publication": "",
    "Date Published": "2017/04/01",
    "Year Published": 2017,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Self-Help",
    "Summary": "Un manuel pratique pour la vie quotidienne qui montre comment nous pouvons développer et maintenir la paix intérieure, comment nous pouvons réduire et faire cesser nos expériences de problèmes et comment nous pouvons apporter des changements positifs dans nos vies, pour nous permettre de connaître un bonheur profond et durable. Il s'agit d'une nouvelle édition, avec d’importants changements, de l'un des livres les plus populaires et accessibles de Vénérable Guéshé Kelsang. A la demande de l'auteur, le livre a été mis à disposition gratuitement en format téléchargeable.« Quand les choses vont mal dans notre vie et que nous rencontrons des situations difficiles, nous avons tendance à considérer que la situation elle-même est notre problème, mais en réalité tous les problèmes que nous connaissons proviennent de l’esprit. Si nous répondions aux difficultés avec un esprit positif ou paisible, elles ne seraient pas un problème pour nous : en effet, nous pourrions même les considérer comme des défis ou des occasions favorables pour grandir et nous développer. Les problèmes n’apparaissent que si nous répondons aux situations avec un état d’esprit négatif. C’est pourquoi, si nous voulons être heureux tout le temps et ne plus avoir de problèmes, nous devons apprendre à développer et maintenir un esprit paisible. »Vénérable Guéshé Kelsang Gyatso Rinpoché",
