    "Original Year Published": "",
    "Edition": "",
    "Genre": "Art",
    "Summary": "Collecting writings from artists, theorists and artist residency facilitators, Contemporary Artist Residencies examines the present role of the residency for artists and the international art ecosystem. With a range of discussions on the continuously evolving role of residencies in our political and historical moment, the book also examines residencies' varied attempts at \"reclaiming time and space\" for artistic practice while serving as nodes for collaboration, research, and critical thinking--not to mention a crucial and sought-after means of promoting artists' career development and the international circulation of their work. The book features contributions by Pascal Gielen, Livia Alexander, Nathalie Anglès, Helmut Batista and Taru Elfving, among others. The latest of Valiz's Antennae series of books designed by Metahaven, Contemporary Artist Residencies helps to fill the surprising gap in books about how and why residencies function in today's art world.",
