    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Pendant quelques mois, trois des plus grands poètes de leur temps échangent un courrier d'une passion extrême. Pasternak est cloué à Moscou par la révolution (il est le docteur Jivago), Tsvétaïeva en France par l'émigration et Rilke en Suisse où il meurt lentement. Seuls Pasternak et Tsvétaïeva se connaissent bien. Rilke n'a jamais rencontré Tsvétaïeva et connaît à peine Pasternak : le lien réel de leur triangle est l'admiration réciproque. L'isolement, l'absence de tout contact et de toute connaissance concrète favorisent l'exaltation, l'idéalisation, le sublime... mais aussi les drames de susceptibilité, jalousie, les remords et les ruptures. La passion amoureuse est indéniablement mêlée à la fougue poétique.",
