    "Summary": "Couleurs et motifs dans l'art textile propose une fascinante analyse des palettes de couleurs employées dans les papiers peints et tissus d'ameublement du XVe siècle à nos jours. Des tapisseries médiévales aux chintz indiens en passant par les broderies Renaissance, chaque textile ou papier peint, présenté par ordre chronologique, est accompagné d'une grille de couleur proportionnelle très simple. Ces palettes montrent clairement les associations de couleurs qui, à travers l'histoire, ont permis de créer les splendides motifs aujourd'hui encore admirés et reproduits. Chaque échantillon est étiqueté avec sa valeur CMJN, permettant ainsi au lecteur de reproduire les différentes associations présentées. Tous les créateurs, aussi bien amateurs que professionnels, trouveront leur inspiration dans ce livre-référence unique en son genre.",
