    "Summary": "Presenting a rich mosaic of embodied contemporary narratives in spirituality and movement studies, this book explicitly studies the relationship between spirituality and the field of Somatic Movement Dance Education. It is the first scholarly text to focus on contemporary spirituality within the domain of dance and somatic movement studies.Dance, Somatics and Spiritualities brings together prominent authors and practitioners in order to elucidate how a wide range of sacred narratives/spiritualities are informing pedagogy, educational and therapeutic practice. As well as providing new insights and promoting creative/artistic awareness, this seminal text de-mystifies the spiritual/sacred and brings clarity and academic visibility to this largely uncharted and often misrepresented subject.",
