    "Genre": "",
    "Summary": "Dans «De la marge au centre. Théorie féministe», son deuxième essai paru en 1984, Bell Hooks poursuit la réflexion entamée dans «Ne suis-je pas une femme?» Elle s'intéresse cette fois-ci aux succès et aux manquements des mouvements féministes des années 1900 à 1980, qui selon elle ont échoué à créer un féminisme de masse qui s'adresse à toutes les femmes. Bell Hooks nous offre un livre coup de poing dans lequel elle pousse les réflexions dans leurs retranchements, tout en préservant un style d'écriture accessible. Elle bouleverse les représentations habituelles de la pensée féministe majoritaire en mettant sur le devant de la scène les femmes noires et/ou les femmes des milieux populaires, en insistant sur le besoin profond d'une approche révolutionnaire du féminisme.",
