    "Genre": "Music",
    "Summary": "\" Un livre magnifique, aussi exaltant qu'édifiant. \" Oliver Sacks  Dans ce livre passionnant, Levitin tente de comprendre le pouvoir de la musique sur l'esprit et étudie la relation entre musique et activité cérébrale : comment le cerveau perçoit-il la musique et qu'est-ce que la musique nous apprend du cerveau ? Les émotions sont des marqueurs neuronaux ; comme déclencheur, la musique nous éclaire sur le fonctionnement de la mémoire. Cet essai enlevé et plein d'humour aborde des thèmes aussi divers que la classification de la musique par genres, l'oreille absolue ou la mémoire instinctive que l'on peut avoir d'un morceau. En se référant à Bach, à Ella Fitzgerald comme aux Beatles, ou à U2, Levitin révèle le rôle de la musique dans l'évolution de l'humanité.",
