    "Genre": "Exhibitions",
    "Summary": "Cette exposition hommage à Edgar Degas (1834-1917) trouve son fil conducteur dans un ouvrage de l'écrivain, poète et penseur Paul Valéry (1871-1945), Degas Danse Dessin. Il s'agit, d'une part, de présenter Degas et Valéry à travers des documents figurés et des documents d'archives. Sont évoqués, d'autre part, à travers de nombreux dessins du premier et les fameux carnets du second, l'importance de ces productions qui ont été, pour l'un et l'autre, le creuset de leur art. A ce titre, une place particulière est faite à la genèse de Degas Danse Dessin. Enfin, les thèmes majeurs explorés dans Degas Danse Dessin sont présentés par l'association d'extraits choisis du texte de Valéry à des oeuvres - dessins, peintures et sculptures - de Degas.",
