    "Year Published": 2013,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Le surdon, réalité avérée aujourd'hui grâce aux neurosciences, se traduit par un mode de fonctionnement du cerveau qui se manifeste, entre autres, par des fonctions sensorielles particulièrement développées. De là résulte un décalage permanent entre la perception de ce que vit le surdoué et la réalité perçue par son environnement social. Le surdoué qui s'ignore éprouve une grande difficulté à gérer cette sensibilité exacerbée à outrance, qui, pour certains, peut aller jusqu'au seuil de l'intolérable, le suicide. Au sentiment d'être \"particulier\", s'ajoute parfois le désespoir de ne pas être compris parce que l'on se croit idiot. Ecrit de l'intérieur, cet ouvrage offre un regard nouveau sur le sujet des adutes surdoués et sur leurs ressentis. S'appuyant sur des recherches effectuées dans les pays où la reconnaissance et la prise en charge du surdon sont bien plus avancées qu'en France, l'auteur raconte son expérience de la différence qu'elle émaille de témoignages d'autres adultes surdoués et propose, dans cette édition augmentée, des pistes pour aller mieux.",
