    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Art",
    "Summary": "- Une approche critique et exemplaire de l'oeuvre graphique de Schiele. 300 illustrations représentatives de Schiele dessinateur reproduite dans un format d'ouvrage séduisant.L'expressionniste autrichien Egon Schiele, mort en 1918 à l'âge de vingt-huit ans, a - malgré la brièveté de sa carrière - laissé une oeuvre prolifique composée de plusieurs centaines d'huiles mais surtout de près de trois mille dessins et aquarelles. Cette part de son oeuvre, de premier plan, n'a jamais été mise en pleine lumière. Les difficultés d'accès à ces oeuvres fragiles, dispersées dans de multiples musées et collections privées, expliquent que l'on ai eu rarement l'occasion de les voir réunies. Ce livre, qui illustre un grand nombre d'oeuvres sur papier de Schiele, offre une possibilité unique de suivre l'évolution rapide de ce dessinateur hors pair au cours de ses douze années d'activité. Jane Kallir, auteur du catalogue raisonné de Schiele, présente la production de l'artiste année après année et analyse les étapes successives de sa progression, depuis le dessinateur prodige qu'il fut enfant jusqu'au maître de la forme et de l'expression qu'il est devenu à la fin de sa courte vie.",
