    "Original Year Published": "",
    "Edition": "",
    "Genre": "Performing Arts",
    "Summary": "Representing the first comprehensive analysis of Gaga and Ohad Naharin's aesthetic approach, this book follows the sensual and mental emphases of the movement research practiced by dancers of the Batsheva Dance Company. Considering the body as a means of expression, Embodied Philosophy in Dance deciphers forms of meaning in dance as a medium for perception and realization within the body. In doing so, the book addresses embodied philosophies of mind, hermeneutics, pragmatism, and social theories in order to illuminate the perceptual experience of dancing. It also reveals the interconnections between physical and mental processes of reasoning and explores the nature of physical intelligence.",
