    "Photographer": "",
    "Editor": "",
    "Publisher": "Ed. Dangles",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 1993,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "D'innombrables personnes ont recouvré leur santé (parfois même à la suite de graves problèmes), et découvert un nouveau bonheur de vivre grâce à la méthode Feldenkrais telle qu'elle est expliquée et mise en exercices dans ce livre (devenu un classique dans son genre et un best-seller aux Etats-Unis). Energie et bien-être par le mouvement offre une voie d'intégration du corps et de l'esprit dans une nouvelle globalité d'être, et fournit - pour l'emprunter et y réussir - les données théoriques indispensables mais simples, ainsi qu'un cycle complet d'exercices, eux aussi faciles à comprendre et à exécuter. Nous agissons, soutient Feldenkrais, en fonction de l'image que nous nous faisons de nous-même, généralement réduite par des facteurs d'hérédité et d'éducation extérieure. Mais chacun a en soi le pouvoir de s'auto-éduquer par la conscience et l'attention, donc de corriger des programmes physiques et psychiques qui, a priori, peuvent paraître inamovibles. La conscience, ajoute Feldenkrais, est la plus haute étape du développement humain, et plus elle s'approche de l'intégralité, plus elle permet d'exercer un contrôle harmonieux sur toute l'activité corporelle. Une conscience augmentée rend aussi chacun apte à libérer, pour l'œuvre créatrice, tout le potentiel énergétique qui est en lui.",
