    "Summary": "Depuis l'exil, le philosophe W. Benjamin recompose, dans une serie de breves vignettes, ses souvenirs d'enfance a Berlin. Loin de l'anecdote, il s'agit d'une veritable plongee dans l'enfance et dans l'histoire, ou se retrouvent les themes essentiels de la philosophie benjaminienne. Ce texte reste inedit du vivant de l'auteur, est desormais connu en plusieurs variantes, dont celle-ci est la derniere a laquelle il ait mis la main. Walter Benjamin (1892-1940) est un philosophe, historien de l'art, critique litteraire, critique d'art et traducteur (notamment de Balzac, Baudelaire et Proust) allemand de la premiere moitie du XXe siecle, rattache a l'ecole de Francfort. Traduction et preface de Pierre Rusch Postscriptum de Patricia Lavelle",
