    "Date Published": "2018/06/26",
    "Year Published": 2018,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\"Cet ouvrage se situe à la croisée des recherches en danse contemporaine et des études littéraires, théâtrales et de la performance. Gestualités et textualités, leurs relations, leurs tensions, délimitent un angle pour aborder la danse contemporaine. On voit de multiplier de nos jours, et sous toutes leurs formes, les croisements du verbal et du kinétique, ainsi que les collaborations entre écrivains et chorégraphes. Pourquoi ces rencontres du texte et du geste ont-elles lieu ? Quels rapports entretiennent aujourd'hui corps et voix, gestes et mots, danse et parole, chorégraphie et écriture ? Ce volume délibérément interdisciplinaire, rassemble les contributions de chercheurs en danse, en littérature, en études théâtrales et en philosophie de l'art, ainsi que des entretiens avec des chorégraphes majeurs de la scène contemporaine (Olivia Grandville, Maguy Marin, Mathilde Monnier, Andrea Sitter).\" [Source : 4e de couv.].",
