    "Summary": "\" In this book, the dancer Steve Paxton traces a lifetime in the company of gravity. The memory of his first flight, a meditation on walking, pondering on the conditions of life, and a dream of dancing make up pieces of a puzzle. He reveals the physical force that is affecting each of us and underpins our personal stories. Paxton muses about the limit of his consciousness and celebrates the potentiality of our senses to enter the dance. Gravity is the first book by Steve Paxton, a major international dancer, choreographer and teacher. Throughout his 55-year career, he has researched the fiction of cultured dance and the \"truth\" of improvisation.\" [Source: site de l'éditeur].",
