    "Summary": "Ce Guide de l'entrepreneur social \"prend par la main\" le porteur de projet désireux de créer ou de développer une entreprise sociale, en répondant à toutes les questions qu'il peut être amené à se poser : Qu'est qu'une entreprise sociale ? Faut-il suivre une formation pour être à son tour entrepreneur social ? - Comment faire son choix parmi toutes les formations existantes ? Quels sont les secteurs d'activité les plus favorables au développement d'une entreprise rentable et utile ? Comment choisir le statut de son entreprise ? Comment favoriser l'utilité sociale de son action ? Où trouver des financements et des soutiens, en phase de création, puis pour changer d'échelle ? Quels sont les grands débats qui animent le secteur de l'entrepreneuriat social ?Pratique et pédagogique, le Guide de l'entrepreneur social s'appuie sur la réalité du terrain, en particulier sur le parcours et l'expérience fructueuse de sept chefs d'entreprises sociales - dont les témoignages et les conseils sont le véritable fil rouge de l'ouvrage.",
