    "Date Published": "2019/05/16",
    "Year Published": 2019,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Habiter le trouble, dit Donna Haraway, est une invitation à penser, à ouvrir de nouvelles possibilités de cohabitation et de continuation, dans des temps de bouleversements écologiques et de violences natureculturelles sans précédent. Accompagnés de deux entretiens (\"Le rire de Méduse\" et \"La tentation de l'innocence\"), les essais ici réunis se présentent comme autant d'enquêtes avec et à partir de Haraway — dans les domaines de l'anthropologie, de la philosophie, des sciences sociales et de la création artistique. Se proposant d'habiter le trouble sur des terrains divers, ces textes portent, chacun à leur façon, le témoignage d'une rencontre située avec l'oeuvre de Donna Haraway. Croisant les figures des cyborgs et des espèces compagnes, auxquelles s'ajoutent aujourd'hui les créatures du Chthulucène, ils proposent de reprendre et de prolonger quelques-uns des motifs majeurs de son travail : le jeu de l'écriture et des tropes, la fabrication des temps et des histoires, l'importance de vivre en mortels, la puissance des politiques féministes.",
