    "Summary": "Un roman longtemps oublié à découvrir de toute urgence dans sa traduction de référence. Trois Américains, intrigués par des légendes locales, découvrent sur une haute montagne un petit pays mystérieux et, à leur grand étonnement, seulement peuplé de femmes. Ils sont les premiers mâles à visiter Herland en près de deux mille ans. Herland est l'une des utopies féministes les plus réussies jamais écrites. Paru en 1915, ce roman de la sociologue Charlotte Perkins Gilman, l'auteure de La Séquestrée, rencontra un grand succès en son temps avant d'être oublié pendant plusieurs dizaines d'années. Redécouvert par la nouvelle génération féministe des années 1960, il ne fut traduit en français qu'en 2016. Un roman culte du féminisme américain à découvrir absolument. \" Un traité féministe sans concessions. Gilman s'aventure là où les progressistes du XXIe siècle n'osent pas aller, au nom de la diplomatie. \" The Guardian",
