    "Genre": "Catalogues raisonnés",
    "Summary": "Renaissance radical: The haunting visions of Hieronymus Bosch  Only 20 paintings and eight drawings are confidently assigned to Netherlandish painter Hieronymus Bosch (c. 1450--1516) but in their fantastical visions they have secured his place as one of the most cult artists in history. 500 years on from his death, his works continue to inspire scholars, artists, designers, and musicians, death metal band names and designer dresses.  This Bibliotheca Universalis edition offers the complete and haunting Bosch world in one compact format. Through full spreads and carefully curated details, we explore the full reach and compelling inventions of the artist's genius as well as disturbing imagination. We encounter his hybrid creatures, his nightmarish scenarios, his religious and moral framework, and his pictorial versions of contemporary proverbs and idioms. Along the way, art historian and Bosch expert Stefan Fischer reveals the most important themes and influences in these cryptic, mesmerizing masterpieces.  About the series: Bibliotheca Universalis-- Compact cultural companions celebrating the eclectic TASCHEN universe at an unbeatable, democratic price! Since we started our work as cultural archaeologists in 1980, the name TASCHEN has become synonymous with accessible, open-minded publishing. Bibliotheca Universalis brings together nearly 100 of our all-time favorite titles in a neat new format so you can curate your own affordable library of art, anthropology, and aphrodisia. Bookworm's delight -- never bore, always excite!",
