    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Art",
    "Summary": "Histoire de l'art de E.H. Gombrich est l'un des ouvrages sur l'art les plus célèbres et les plus populaires jamais publiés. Depuis plus de cinquante ans, il demeure une introduction inégalée à l'ensemble du sujet, des premières peintures rupestres à l'art d'aujourd'hui. Dans le monde entier, les lecteurs de tous âges et de tous milieux ont trouvé en Gombrich un véritable maître, qui allie la connaissance et la sagesse à un don unique pour communiquer directement sa profonde affection pour les œuvres qu'il décrit. Cette Histoire de l'art doit sa popularité durable au style simple et direct de l'auteur, ainsi qu'à son ton narratif. Son but, écrit-il, est \" d'apporter un certain ordre, une certaine clarté dans l'abondance de noms propres, de dates, de styles qui compliquent quelque peu les ouvrages plus spécialisés \". Grâce à son intelligence de la psychologie des arts visuels, il nous fait percevoir l'histoire de l'art comme un \" enchaînement interrompu de traditions encore vivantes \" qui \" relie l'art de notre temps à celui de l'âge des pyramides \". Avec cette édition au format de poche, le succès toujours grandissant de ce classique va se confirmer auprès des générations futures et celui-ci demeurera sans aucun doute l'ouvrage de référence pour tout amateur d'art.",
