    "Summary": "Médecin érudit, Élie Faure compose en une vingtaine d'années (1909-1927) une monumentale Histoire de l'art, de la préhistoire au début du XXe siècle. Issu de conférences données à l'université populaire du 3e arrondissement de Paris, ce travail, sans cesse remanié, n'est pas l'oeuvre d'un universitaire mais celle d'un passionné guidé par ses émotions, qui souhaite partager son enthousiasme. Ce premier volume, dont l'auteur s'est souvent déclaré insatisfait, traite de l'art préhistorique, égyptien, oriental (Mésopotamie, Assyrie, Perse), grec et romain. Par son évocation de l'art grec notamment, celui qu'Henry Miller qualifiait de « magicien » rend un vibrant hommage à l'art et, à travers lui, à la vie.",
