    "Editor": "",
    "Publisher": "Thames & Hudson",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 2018,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "When we are born, we are each assigned a gender based on our physical anatomy. But why is it that some people experience dissonance between their biological sex and their personal identity? Is gender something we are, or something we do? Is our expression of gender a product of biology, or does it develop based on our environment? Are the traditional binary male and female gender roles relevant in an increasingly fluid and flexible world? Sally Hines, whose work on transgender issues draws on the intersections and disconnections of gender, sexuality, and their biological embodiment, is an ideally well-informed author to explore these questions. Supplementing this text are numerous illustrations that provide an accessible and informative visual component to the book.This intelligent volume in the Big Idea series considers the relations between gender, psychology, culture, and sexuality, examining the evolution of individual and social attitudes over the centuries and throughout the world.",
