    "Summary": "En 2003, le chorégraphe Boris Charmatz et l'Association edna ont mis en place un dispositif de recherche et de création pédagogiques intitulé Bocal. L'enjeu de ce projet nomade et provisoire était de mettre l'école à l'épreuve de l'esthétique et du politique en réunissant une quinzaine de personnes de 20 à 30 ans : danseurs, médecin, plasticiens, designers, écrivains, circassien et musiciens. Tous se sont engagés dans une aventure \" sans fin \" ; il ne s'agissait pas d'obtenir un diplôme, ni de se perfectionner ou d'acquérir de nouvelles techniques, mais de penser l'école comme puissance de création, d'activer son potentiel émancipateur. Dans différents contextes, ils ont conçu leurs outils de formation, questionné les figures du professeur et de l'élève, inventé les modalités de leur enseignement, en résumé, conçu un programme scolaire comme autant d'actes artistiques possibles... Ce projet, qui interrogeait l'institution sans pour autant chercher à fonder un nouveau modèle, a généré un vaste répertoire d'idées, de débats et de propositions, entre action et utopie, création et enseignement. Sans omettre de souligner les limites que le \" réel \" pose à toute pratique d'invention collective, \" je suis une école \" donne à comprendre comment la recherche d'une pédagogie singulière aide à conquérir une autonomie, tout en soulevant une multiplicité d'interrogations. On le voit : en relatant cette expérience inédite, c'est à des questions beaucoup plus larges que se confronte Boris Charmatz. Sont ainsi convoqués Jacques Rancière et son \" maître ignorant \", Roland Barthes et le concept d'idiorrythmie, Robert Filliou et Isadora Duncan, mais aussi, de part en part, la politique contemporaine au travers d'une critique de la place de l'art et de l'expérimentation (et donc du possible) dans notre société.",
