    "Summary": "Charlie Evans est un brillant violoniste qui, plein d'amertume après avoir été envoyé au casse-pipe dans un concert cauchemardesque, a abandonné le violon et toute idée de vie régulière. Rêvant de quitter la ville, il habite dans un hôtel miteux au milieu de divers désaxés, dont une vieille connaissance, Tinsel Greetz, anarchiste de pacotille et charlatan avéré. Ne cessant de se houspiller et de s'affronter, Tinsel et Charlie forment pourtant une équipe formidable et, quand ils obtiennent un boulot parfaitement illégal mais hautement lucratif, consistant à massacrer les rats dans les égouts, ils deviennent une véritable terreur. Après avoir claqué leur paie durement gagnée, tous deux se réveillent dans un étrange hôtel (cinq étoiles !) avec la pire gueule de bois de leur vie. Et quand Charlie fait la connaissance de l'ensorcelante Louise qui les y a accueillis, eh bien, le voilà embringué dans une nouvelle série d'aventures.",
