    "Genre": "Art",
    "Summary": "Questo libro d'artista accompagna la ricerca messa in atto dall'artista ceco Kristof Kintera (Praga, 1973) per la realizzazione di Postnaturalia, una complessa installazione scultorea esposta presso la Collezione Maramotti.Alla base della riflessione, l'idea che lo scenario in cui si inscrive la nostra esperienza quotidiana non sia più quella del mondo naturale: nella cosiddetta \"età del rame\", basata sulla trasmissione di energia e informazioni, la natura viene ricreata in uno spazio para-vegetale, paragonabile a un ampio e intricato sistema nervoso.Il volume è composto da due sezioni: Herbarium e Cuprum Factum. La prima pone in dialogo, attraverso l'analogia, le nuove creazioni di sintetica bellezza con disegni o incisioni storiche o pagine di erbari di soggetti botanici, molti dei quali tratti dalle Collezioni naturalistiche dei Musei Civici; la seconda accoglie testi e immagini sul processo di creazione delle opere in laboratorio e quelle presentate nella mostra di Reggio Emilia.Kintera si insinua nel tema del \"post-naturale\" con vivide suggestioni visive che conduce con spirito ironico, giocoso ma anche amaro, nel quadro di una complessa interrogazione sociale e politica sul nostro tempo, mosso dalla speranza di sollecitare consapevolezza su una questione di grande attualità.",
