    "Date Published": "2015/11/05",
    "Year Published": 2015,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Urgences professionnelles, deadlines imminentes, clients mécontents, projets chronophages qui empiètent sur la vie personnelle : le rythme de travail des créatifs est effréné et souvent stressant. Dans une société où tout - des technologies aux cadences de vie - va plus vite, il est nécessaire de faire une pause et de prendre du recul. C'est ce que propose ce livre, en mettant l'accent sur les grands courants spirituels encore influents à notre époque (philosophie zen, bouddhisme, christianisme) et en exposant les vertus de la pleine conscience, du calme, du silence et... du thé ! Ces éléments, apparemment anodins, sont non seulement bénéfiques pour la créativité, mais ils permettent également d'atteindre le bien-être dans la vie quotidienne, de se sentir libre dans son travail, en un mot d'élaborer un véritable art de vivre.",
