    "Genre": "Water",
    "Summary": "À l’écoute de l’eau et de ses mystères, Gaston Bachelard entraîne son lecteur dans une superbe méditation sur l’imagination de la matière. Son domaine s’élargit, le philosophe se laissant davantage guider par les images des poètes, s’abandonne à sa propre rêverie. Des eaux claires, brillantes où naissent des images fugitives, jusqu’aux profondeurs obscures, où gisent mythes et fantasmes. Avec 'L’eau et les rêves', la méthode de Bachelard s’assouplit - il ne s’agit plus d’une psychanalyse, mais, comme l’indique le sous-titre, d’un 'Essai sur l’imagination de la matière', en même temps que son domaine s’élargit et que le philosophe se laisse davantage guider par les images des poètes, s’abandonne à sa propre rêverie.",
