    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "La modernité démocratique a fait du bonheur une idée neuve, un principe constitutionnel, presque un devoir. Dès lors que l'individu est reconnu comme la figure centrale du monde, son bonheur devient l'objectif de la société tout entière. Si le bonheur est in fine la mesure de tout choix, il importe de lui trouver une métrique, même approximative. C'est pourquoi un nouveau matériau, accumulé depuis une quarantaine d'années, vient étendre le champ des grandeurs observables par les chercheurs en sciences sociales. Il s'agit du niveau de bonheur déclaré par les individus lors des grandes enquêtes auprès de la population, qui vient s'ajouter aux grands indicateurs mesurant la richesse d'une société. La problématique centrale de l'économie du bonheur concerne la croissance. Cette dernière rend-elle vraiment les gens plus heureux ? Dans le cas contraire, faut-il mesurer le bien-être au-delà du PIB, voire changer de modèle économique ?",
