    "Summary": "Années 1950, La Nouvelle-Orléans, où la fête de Mardi gras bat son plein. Grâce à Weekly, un producteur de jazz dénommé Faust fait la connaissance de Blacksad. Faust demande à ce dernier de s'occuper d'une affaire : un de ses musiciens, le pianiste Sebastian, a disparu. Il n'a pas donné signe de vie depuis des mois, mettant en péril le label musical privé d'une star. Faust craint que Sebastian ait, une fois de trop, sombré dans la drogue. Sa requête est d'autant plus pressante que Faust se sait atteint d'un cancer. Blacksad accepte la mission et découvre peu à peu que Faust ne lui a pas tout dit. Il s'aperçoit qu'il est lui-même manipulé, mais décide tout de même de retrouver Sebastian pour comprendre les raisons de sa disparition. Il ne sait pas encore qu'il va connaître son enquête la plus éprouvante, à plus d'un égard.",
