    "Summary": "Le premier manuel pour élaborer efficacement le business plan ,'une entreprise à finalite sociale. Cet ouvrage propose une méthodologie d'élaboration d'un business plan adaptée à des projets à finalité sociale. Véritable manuel pour agir, il met à disposition des porteurs de projets et des entrepreneurs sociaux un outil pratique pour concevoir une stratégie de mise en oeuvre efficace et pérenne. Il met en évidence les éléments spécifiques à un projet à finalité sociale - comme les indicateurs d'évaluation de l'impact social. Synthèse de nombreuses années de pratique pédagogique auprès d'entrepreneurs sociaux en herbe ou confirmés, ce manuel bénéficie de l'expérience acquise par les deux auteurs au sein d'Antropia - premier incubateur d'entreprises sociales porté par une grande école de management en France. Pour étayer et illustrer leurs propos, Thierry Sibieude et Marie Trellu-Kane s'appuient sur de nombreux exemples de business plans élaborés par des entreprises sociales dont ils ont accompagné le développement.",
