    "Edition": "",
    "Genre": "",
    "Summary": "Les êtres qui se reproduisent, les êtres reproduits, sont des êtres distincts entre eux, séparés par un abîme, une fascinante discontinuité. Mais, individus mourant isolément dans une aventure inintelligible, nous gardons la nostalgie de la continuité perdue. L’activité sexuelle de reproduction, dont l’érotisme est une des formes humaines, nous la fait retrouver ; au moment où les cellules reproductrices s’unissent, une continuité s’établit entre elles pour former un nouvel être à partir de leur mort. C’est aussi par la mort, la mort violente, que cet effort de libération s’est manifesté dès l’origine des activités de l’homme. Mais le désir de meurtre met en cause toute l’organisation de communautés fondées sur le travail et la raison. D’où la naissance d’interdits, à quoi s’oppose, ou plutôt s’ajoute, en un dépassement nécessaire, leur propre transgression. Guerre et chasse rejoignent ici l’inceste ou l’orgie sacrée...",
