    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\"Des politiques en faveur de l'innovation sociale se mettent en place à différents niveaux (local, régional, national, européen). Pour autant et malgré l'augmentation exponentielle des références dans la littérature internationale, peut-on s'accorder sur une vision de l'innovation sociale ? Pour les auteurs réunis ici, elle ne constitue ni une recette ni la simple diffusion de ce qu'on appelle des \"bonnes pratiques\", qui opèreraient dans des systèmes économiques et sociaux inchangés. En effet, les capacités d'initiative de la société civile exigent des changements dans les cadres institutionnels pour construire un nouveau modèle de société inclusif, solidaire et écologique. À partir de l'expérience et des acquis de trois équipes de recherche qui y réfléchissent depuis plus de vingt ans, cet ouvrage alimente le débat théorique sur l'innovation sociale. Il explique aussi pourquoi la thématique est apparue dans une période de mutations contemporaines et montre l'importance pratique qu'elle peut revêtir à travers des exemples de territoires comme de secteurs.\" P. 4 de la couv.",
