    "Genre": "Fiction & Literature",
    "Summary": "Dans un monde dystopique furieusement proche du nôtre, le jeune Alex s'ingénie à commettre le mal sans le moindre remords : en compagnie de ses drougs, il se livre à la bastonnade, au viol et à la torture sur fond de musique classique. Bientôt incarcéré, il subit un traitement chimique qui le rend allergique à toute forme de violence. Tout le génie de Burgess éclate dans ce livre sans équivalent, entre roman d'anticipation et conte philosophique. Le romancier, qui fut linguiste et compositeur, réussit en outre le prodige d'inventer une langue, le nadsat, dans laquelle son héros raconte sa propre histoire. À l'occasion du centenaire de la naissance d'Anthony Burgess, son roman culte, L'Orange mécanique, s'enrichit aujourd'hui d'une postface inédite de l'auteur sur le film qu'en tira Stanley Kubrick, ainsi que de fac-similés de son tapuscrit, illustré de ses propres dessins, permettant de jeter un éclairage nouveau sur ce classique de la littérature anglaise. \" Je ne connais aucun écrivain qui soit allé aussi loin avec le langage. \" William S. Burroughs",
