    "Summary": "Tout commence et s'achève avec la porte de la maison d'enfance. Comment accueillir son monde, un 1er Mai, quand il n'y a pas de table assez grande tous les bergers descendus de la montagne, les ouvriers agricoles, les camarades fomentant la grève générale ? A bout de bras, le père extirpe alors de ses gonds la lourde porte qu'il vient lui-même de construire et la couche sur deux tréteaux. Pour l'enfant ébahi, c'est le monde qui s'inverse... Après le Trésor de la guerre d'Espagne qui nous avait fait découvrir le singulier talent de Serge Pey, la Boîte aux lettres du cimetière vient confirmer un ton unique dans l'art du récit, avec ces trente histoires cruelles, drolatiques ou tendres des histoires à couper le souffle, tant par leur beauté immédiate, brutale, que par l'univers à la fois charnel, réalise et enchanté qui se dévoile à nous.",
