    "Summary": "Les enseignements bouddhistes sur l'entraînement de l'esprit (lodjong en tibétain) sont réputés pour leur sagesse particulièrement pénétrante. Ce livre très inspirant nous explique l'entraînement de l'esprit en sept points, poème du grand pratiquant kadampa, Guéshé Tchékhawa (1102-1176). Grâce à ce texte et au commentaire de Guéshé Kelsang, nous découvrons l'amour inconditionnel et la grande compassion. Ce sont des qualités qui sont au cœur même des enseignements de Bouddha. Elles nous donnent la capacité de transformer nos difficultés quotidiennes en des possibilités de croissance personnelle et spirituelle. L'auteur nous montre le chemin de la liberté et du bonheur, et nous donne envie de le suivre. En cultivant une compassion dotée de sagesse, nous découvrirons qu'il n'y a aucune contradiction entre prendre soin de soi-même et prendre soin des autres. Ce livre aura un impact remarquable sur notre vie.",
