    "Summary": "Chercheur, économiste et grand amateur de danse, Patrick Germain-Thomas nous livre une étude précise sur l'émergence de la danse contemporaine en France des années 1970 à aujourd'hui autant qu'un manifeste formulant les combats à mener pour sa reconnaissance. En dépit de l'évidence avec laquelle la danse contemporaine s'est imposée sur les scènes françaises et étrangères, elle éprouve encore des difficultés à pénétrer la société dans son ensemble. Sa diffusion pose question. La politique de l'offre qui la caractérise génère un accroissement régulier du nombre de spectacles créés chaque année, dépassant les capacités de programmation des théâtres et festivals, et assignant les compagnies à une position de double dépendance : vis-à-vis des aides publiques et des choix des diffuseurs. Il apparaît aujourd'hui nécessaire de repenser le marché subventionné de la danse contemporaine, structurellement déséquilibré. Car après avoir réussi sa révolution esthétique, la danse contemporaine doit conforter son modèle économique 4 et son ancrage social pour envisager un avenir pérenne.",
