    "Editor": "",
    "Publisher": "La Fabrique éditions",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 2017,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "La culture officielle est devenue une entreprise qui a pour employés les poètes et les artistes. Ils ont des comptes à rendre à leur employeur : la prolétarisation des savoir-faire de l'art et de la pensée oblige à l'autocensure et au formatage des oeuvres commandées. L'entreprise culture, qui prône un humanisme universel, exporte le bon art et la bonne parole dans les quartiers populaires pour éduquer la plèbe, celle qui n'a pas les bons codes et qui n'est pas encore docilisée. Le mécénat privé est l'autre face de l'entreprise culture. Vuitton et son cadeau aux Parisiens, le \"grand oiseau blanc\" au bois de Boulogne ; Benetton et son projet \"Imago Mundi\", collection d'oeuvres commandées à des artistes du monde entier - mais pas aux enfants qu'il fait travailler en Tunisie ou au Cambodge pour des salaires de misère ; Lacoste et la fondation Cartier qui refusent que l'on parle de la Palestine dans leurs manifestations : la culture comme promotion de marques est elle aussi une mécanique de pacification efficace et rentable. \"L'entreprise culture est la place forte où se travaille la langue de la domination, celle qui crée les fictions et les divertissements indispensables à l'évitement de toute velléité critique.\"",
