    "Date Published": "",
    "Year Published": 2017,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Depuis une trentaine d'années, la politique culturelle en France est de plus en plus déclinée sous la forme d'une abondante offre de spectacles plus ou moins subventionnés par l'Etat et les collectivités, et ce, à tous les échelons du territoire. De ce fait, les programmateurs et programmatrices de spectacles jouent un rôle essentiel puisqu'il leur appartient de convertir des spectacles particuliers en intérêt public. La Fabrique de la programmation culturelle est le premier livre qui s'intéresse à la formation, au travail, aux outils, aux compétences, aux réseaux de ces femmes et de ces hommes professionnels et aux multiples contraintes qu'ils doivent gérer. S'appuyant sur une exploration des espaces de travail et de rencontres, l'enquête met en évidence la dimension collective de cette expertise, la force et la diversité de ce groupe social. Dans un contexte où les profanes s'impliquent de façon croissante dans l'espace public (santé, nucléaire, alimentation, écologie, etc.), cette façon de produire de la \"culture\" interroge la définition des politiques publiques, leur mise en oeuvre et leur évaluation.",
