    "Summary": "Aujourd'hui, à l'ère du numérique, la création se donne dans une interaction nouvelle avec le domaine des sciences du vivant, les neurosciences, la biologie synthétique. C'est la matière même qui est explorée. Les biotechnologies sont à présent utilisées comme médium par les artistes, les designers ou les architectes. Si les outils numériques de simulation générative autorisent la recréation du vivant, la question qui se pose aujourd'hui est : comment programmer le vivant ? \"La Fabrique du vivant\" retrace une archéologie du vivant et de la vie artificielle. Plusieurs essais dans le champ de l'épistémologie du vivant, de l'architecture, de l'histoire de l'art et du design ainsi que de la prospective industrielle interrogent les enjeux de la biofabrication dans la conception d'objets durables ou ceux d'une architecture bio-computationnelle qui met en oeuvre de nouvelles formes de nature artificielle. Une cinquantaine de créateurs — artistes, designers, architectes — questionnent ce nouvel écosystème numérique.",
