    "Genre": "Biography",
    "Summary": "\"\"Vers 15 ans, j'ai rencontré l'objet de mon désir. C'était dans un livre consacré à la peinture italienne: une femme vêtue d'un corsage blanc se dressait sur un fond noir; elle avait des boucles châtain clair, les sourcils froncés et de beaux seins moulés dans la transparence d'une étoffe.\" Ainsi commence ce récit d'apprentissage qui se métamorphose en quête de la peinture. En plongeant dans les tableaux du Caravage (1571-1610), en racontant la vie violente et passionnée de ce peintre génial, ce livre relate une initiation à l'absolu. À notre époque d'épaississement de la sensibilité, regarder la peinture nous remet en vie. On entre dans le feu des nuances, on accède à la vérité du détail. C'est une aventure des sens et une odyssée de l'esprit. Aimer un peintre comme le Caravage élargit notre vie.\"--Page 4 de la couverture.",
