    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\" La Voie est nécessaire à l'homme, autant que l'air ou la nourriture. Elle tire l'homme hors de la détresse. La Voie est tendresse. Mais la tendresse de la Voie n'est pas ce que nous nommons tendresse. Aucun nom commun ne la nomme. On ne peut ni la décrire, ni l'apprendre, ni l'enseigner... La tendresse est amour de tout ce qui est, jubilation de toute naissance, désir encore et encore que tout vivant vive et donne son fruit.\" La Voie est sûrement l'oeuvre la plus universelle de Maurice Bellet (1923-2018). Le théologien et psychanalyste a trouvé là une manière unique et totalement adogmatique de toucher une dimension de l'être que tout lecteur peut, grâce à lui, appréhender quelles que soient ses croyances.",
