    "Date Published": "2019/04/19",
    "Year Published": 2019,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Comment faire tourner les usines sans les travailleurs vigoureux, nourris, blanchis, qui occupent la chaîne de montage ? Loin de se limiter au travail invisible des femmes au sein du foyer, Federici met en avant la centralité du travail consistant à reproduire la société : combien coûterait de salarier toutes les activités procréatives, affectives, éducatives, de soin et d'hygiène aujourd'hui réalisées gratuitement par les femmes ? Que resterait-il des profits des entreprises si elles devaient contribuer au renouvellement quotidien de leur masse salariale ? La lutte contre le sexisme n'exige pas tant l'égalité de salaire entre hommes et femmes, ni même la fin de préjugés ou d'une discrimination, mais la réappropriation collective des moyens de la reproduction sociale, des lieux de vie aux lieux de consommation — ce qui dessine l'horizon d'un communisme de type nouveau.",
