    "Summary": "Au contraire de l'anatomie—science théorique et lacunaire, nous dit Antoine Barjini - la morphologie est une science de l'observation du vivant, dont l'étude est d'autant plus nécessaire aujourd'hui qu'elle permet de redécouvrir et de réhabiliter l'image du corps, devenue abstraite, soumise aux idéaux publicitaires et non représentative de la diversité humaine. Mêlant l'observation, la pratique du dessin et la relation aux oeuvres d'art, ce livre permet de toucher du doigt des interprétations inhabituelles qui enrichissent la manière dont on peut observer un corps. De cette démarche découle l'évidence que chaque partie du corps, loin de se réduire à quelques volumes simples, éveille un univers, un champ de possibilités. Pour Antoine Barjini, la morphologie sert à regarder les autres avec des yeux ouverts et bienveillants et à apprécier les différences et les singularités.",
