    "Edition": "",
    "Genre": "",
    "Summary": "Le cuir séduit depuis la nuit des temps et fait partie de notre quotidien. Matière renouvelable unique et innovante, source de créativité intarissable, le cuir se décline à l'infini et se révèle une matière de prédilection pour une création insoupçonnée. L'étendue toujours plus large de ses applications, de l'accessoire de mode à l'univers de la décoration ou encore aux milieux industriels, confirme son formidable potentiel. Avec ce nouvel ouvrage de CTC découvrez en images et échantillons à 1'appui \" le cuir dans tous ses états \" ! Incontournable, il aborde de manière pédagogique tous les stades de sa vie depuis la matière première. Le tannage transforme la peau en un matériau polysensuel, le cuir. Il présente les différentes finitions, l'entretien, le contrôle qualité, la relation cuir et environnement... avant de conclure sur l'incroyable pouvoir d'attraction de ce matériau pluriel qui parle à nos sens les plus profonds.",
