    "Place of Publication": "",
    "Date Published": "2016/05/18",
    "Year Published": 2016,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Voici la première thèse (en sciences de l'éducation) jamais réalisée sur le sol américain dans le langage de la bande dessinée. Nick Sousanis l'a soutenue en mai 2014 à l'université de Columbia. L'édition originale (intitulée Unflattening) a été publiée en 2015 aux Presses universitaires de Harvard, avec un retentissement considérable dans la presse et sur les réseaux sociaux. Dans cette épopée scientifique, entre sémiotique et épistémologie, Sousanis s'intéresse aux limites de notre système perceptif, à nos conditionnements et aux moyens de nous en libérer pour déployer nos potentialités (multimodalité, interdisciplinarité, collaboration entre l'image et le texte ...). Il réfléchit plus largement à la condition humaine, à ce que c'est que d'être au monde, à la conscience, à la possibilité d'une compréhension qui aille plus loin que les sens. Fondé sur de très nombreuses références scientifiques (comme en témoigne la bibliographie), ce travail est aussi un éloge de la bande dessinée qui, selon l'auteur, est un langage qui permet de déployer la pensée et qui a des vertus pédagogiques exceptionnelles. Et Sousanis ne se contente pas de l'affirmer : il le prouve, en utilisant toutes les ressources de la pensée visuelle (graphiques, dessin réaliste, allégories ...), avec une formidable inventivité. Il pousse le genre de l'essai en bande dessinée plus loin que Scott McCloud, et nous propose une expérience de lecture inédite.",
