    "Genre": "Choreography",
    "Summary": "\"Penser les images d'histoire, d'actualité et d'art comme un grand montage toujours en mouvement, images qui se répondent ou se font écho les unes les autres, reliées par le regard de celui qui regarde, lui-même relié, par les images elles-mêmes, au regard d'un autre regardant. Un montage jamais terminé, se construisant et se déconstruisant pour se reconstruire encore sans cesse sous l'effet multiplié de regards nouveaux se questionnant mutuellement sur ce qu'il leur est donné à voir. Un lent tourbillon sur lequel nous posons lentement nos yeux.\" Par ces mots, Maguy Marin revient sur le patient travail qui, de pièce en pièce, ne cesse de donner de nouvelles formes à un questionnement aigu et inépuisé du monde, mettant ainsi le spectateur en activité. C'est de la rencontre avec le fil, polyphonique, de cette exigence artistique jamais close qu'est né ce livre fait de regards les uns aux autres entretissés.",
