    "Summary": "Écoutez ma parole, dit gravement madame la Santé, Conservez bien dans vos esprits une grande vérité. Je suis, sur cette terre, la fortune sans égale, incomparable Le don le plus précieux de ce monde, c’est incontestable De l’activité la sagesse, l’intime inséparable amie, De la paresse et la mollesse l’implacable ennemie, On doit agir résolûment, se mouvoir à tout âge, Montrer de l’énergie, sans cesse du courage.Fruit d’une sélection réalisée au sein des fonds de la Bibliothèque nationale de France, Collection XIX a pour ambition de faire découvrir des textes classiques et moins classiques dans les meilleures éditions du XIXe siècle.",
