    "Summary": "Installée dans un refuge high-tech accroché à une paroi d'un massif montagneux, une femme s'isole de ses semblables pour tenter de répondre à une question simple : comment vivre ? Outre la solitude, elle s'impose un entraînement physique et spirituel intense, où longues marches, activités de survie, slackline et musique vont de pair avec la rédaction d'un journal de bord. Saura-t-elle \"comment vivre\" après s'être mise à l'épreuve de conditions extrêmes, de la nature immuable des temps géologiques, de la brutalité des éléments ? C'est dans l'espoir d'une réponse qu'elle s'est volontairement préparée, qu'elle a tout prévu. Tout, sauf la présence, sur ces montagnes désolées, d'une ermite, surgie de la roche et du vent, qui bouleversera ses plans et changera ses résolutions. Avec son style acéré, Céline Minard nous offre un texte magistral sur les jeux et les enjeux d'une solitude volontaire confrontée à l'épreuve des éléments.",
