    "Summary": "Cette présentation entièrement nouvelle, proposée par l'auteur d'Un Bouddhisme moderne, offre au lecteur contemporain des conseils et des prises de conscience profondément libérateurs. Ce livre révèle la signification profonde du coeur même des enseignements de Bouddha, Les Soutras de la perfection de la sagesse. L'auteur nous montre comment tous nos problèmes et toutes nos souffrances proviennent de notre ignorance de la nature ultime des choses. Il nous montre comment nous pouvons abandonner cette ignorance et parvenir à ressentir un bonheur pur et durable, en utilisant une sagesse spéciale associée à un sentiment de compassion pour tous les êtres vivants.",
