    "Genre": "Self-Help",
    "Summary": "Un guide pour la méditation bouddhiste, pratique et inspirantDécouvrir la paix intérieure de la méditationAppliquer la méditation à notre vie quotidienneAvoir une vie heureuse et lui donner du sensLe Nouveau Manuel de Méditation est un guide de méditation pratique qui enseigne comment trouver le bonheur et rendre les autres heureux en faisant grandir notre paix intérieure, et ainsi donner plus de sens à notre vie.Sans paix intérieure, il n'y a aucun véritable bonheur. Problèmes, souffrances et malheurs n’existent pas à l’extérieur de l’esprit ; ce sont des sensations et elles font donc partie de notre esprit. Ainsi, c'est seulement en contrôlant notre esprit que nous pouvons faire définitivement cesser tous nos problèmes et rendre tout le monde heureux, nous-mêmes et les autres.Les vingt et une pratiques de méditation bouddhiste présentées dans ce livre sont de véritables méthodes pour contrôler notre esprit et connaître une paix intérieure durable. Ce guide extrêmement pratique est un manuel indispensable pour les personnes qui désirent être heureuses et donner du sens à leur vie.",
