    "Genre": "Buddhism",
    "Summary": "Le Nouveau Manuel de Méditation est un guide de méditation pratique qui enseigne comment trouver le bonheur et rendre les autres heureux en faisant grandir notre paix intérieure, et ainsi donner plus de sens à notre vie. Sans paix intérieure, il est impossible de connaître le vrai bonheur. Les problèmes, les souffrances et les malheurs n'existent pas à l'extérieur de l'esprit ; ce sont des sensations et elles font donc partie de notre esprit. Contrôler notre esprit est alors le seul moyen pour faire cesser définitivement tous nos problèmes et rendre tout le monde heureux, nous-mêmes et les autres. Les vingt et une pratiques de méditation bouddhiste présentées dans ce livre sont de véritables méthodes pour contrôler notre esprit et connaître une paix intérieure durable. Ce guide, présenté de manière simple, est un manuel indispensable pour les personnes qui désirent être heureuses et donner du sens à leur vie.",
