    "Title": "Le sexe et la langue",
    "Original Title": "",
    "Subtitle": "petite grammaire du genre en français, où l'on étudie écriture inclusive, féminisation et autres stratégies militantes de la bien-pensance",
    "Series": "",
    "Volume": "",
    "Author": "Jean Szlamowicz, Xavier-Laurent Salvador",
    "Author (Last, First)": "Szlamowicz, Jean",
    "Illustrator": "",
