    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Il ne faut pas confondre la langue et le sexe, le genre des mots et le sexe des gens. Or, avec une déconcertante régularité, les débats de société mélangent volontiers le mot et la chose. Le Sexe et la Langue tente de faire un état des lieux des manipulations militantes prenant la langue en otage et le féminisme pour prétexte d'une manoeuvre d'intimidation idéologique. Dernier avatar de ces manipulations, l'écriture inclusive s'abrite derrière la défense des femmes pour contribuer à e changer les mentalités e en tordant le cou à la grammaire. Contre l'usage populaire, une entreprise de contrôle moral des discours vise désormais à légiférer la langue française. Ce contrôle est l'oeuvre de gardiens de prison qui prétendent que leur surveillance vous libère et qui veulent imposera' la société une rééducation comportementale et mentale. Ace titre, ils ont raison : la langue est bien un enjeu à partir du moment où on l'enrôle pour en faire une arme de pouvoir.",
