    "Genre": "",
    "Summary": "\"Issu de la Chine ancienne, le taoïsme repose sur la notion de \"dao\", le Souffle donnant vie à toute chose. Depuis vingt-cinq siècles, il a irrigué et enrichi les principaux courants spirituels orientaux. Véritable enseignement, il est d'abord un mode d'existence permettant à chacun de revenir à l'essence de la vie. Bernard Baudouin présente les éléments essentiels de cette \"philosophie religieuse\" et en dévoile les subtilités à travers ses sources, notamment le Dao De Jing, Le Livre de la Voie et de la Vertu, attribué à Laozi ; ses auteurs essentiels, tels Zhuangzi et Liezi ; sa doctrine (les notions de dao, de yin-yang et de wu-wei) ; ses cultes et rituels ; son impact et son évolution dans l'Histoire. Toujours très vivante en Chine, la parole taoïste a en effet essaimé dans le monde entier. Elle propose de ramener l'homme en son propre centre afin qu'il y découvre l'harmonie, la paix intérieure et l'immortalité (4e de couv.)",
