    "Summary": "Les pratiques essentielles du bouddhisme mahayana. Un guide pratique du mode de vie du bodhisattva. Une explication des voeux du bodhisattva et des six perfections. Un compagnon idéal pour les pratiquants du bouddhisme mahayana. Un bodhisattva est une personne motivée par le désir d'atteindre la pleine illumination pour le bien des autres. Pour accomplir ce désir, il, ou elle, prend les voeux du bodhisattva et les observe en pratiquant les six perfections : le don, la discipline morale, la patience, l'effort, la concentration et la sagesse. L'auteur donne des conseils clairs et précis sur chaque aspect de l'éthique du bodhisattva, et il explique également une puissante pratique de purification de l'esprit. Avec ce livre comme compagnon, chacun peut adopter le mode de vie d'un bodhisattva et avancer vers la félicité suprême de la pleine illumination.",
