    "Summary": "Marguerite n'a qu'un désir : un enfant. Une nuit, une chimère vient la visiter, lui enjoignant de se rendre dans la Forêt Noire où la semence dont elle a besoin existe hors de l'homme. Après d'étranges expérimentations, elle tombe enceinte. Daisy naît, grandit. Marguerite ne parvient pas à accepter que l'enfant se détache d'elle. Des événements bizarres surviennent... Le premier roman de Justine Arnal fait fi de tous les clichés. Ancré dans une société bien réelle, le merveilleux y règne en maître, la névrose aussi. Sans doute celle de notre époque qui glorifie la relation mère-enfant. Il faudra bien pourtant que l'obsession de Marguerite pour sa fille prenne fin, si Daisy veut pouvoir exister à part entière. Ce ne sera pas sans peine ni sacrifice propitiatoire. C'est avec une évidente connivence que Lola B Deswarte met son imagination au diapason du récit. Les hybrides, chimères et autres créatures qu'elle invente éclairent étonnamment l'univers foisonnant de Justine Arnal.",
