    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "La danse macabre, connue surtout en France par les fresques de La Chaise-Dieu ou la musique de Saint-Saëns, représente un thème littéraire et iconographique très répandu dans la chrétienté occidentale à partir du XVe siècle. Les interrogations anciennes sur l'au-delà, l'angoisse causée par les hécatombes de la Peste noire (1350) donnent à ce thème, en se chargeant de satire sociale, une médiatisation extraordinaire grâce à l'imprimerie. La France fut probablement l' \" accoucheuse \" de la danse macabre, ancrée aujourd'hui dans la culture populaire. Réveillé par les deux guerres mondiales, le thème reflète les préoccupations contemporaines en tendant vers la caricature politique ou l'onirisme. Le thème des danses macabres resitue la place de la mort dans les sociétés actuelles.",
