    "Summary": "\"On ne naît pas artiste mais on le devient. Du plus loin qu'on s'en souvienne, l'histoire de l'art a été pensée, écrite, publiée, transmise par des hommes. Et quand on est née femme, être artiste, le prouver, y avoir accès, produire, montrer, continuer à le demeurer est un combat permanent, dangereux, épuisant physiquement, intellectuellement et psychiquement. Le temps semble aujourd'hui propice pour revisiter et regarder autrement les créations de celles qui ont eu le courage de défier les règles pour assouvir leur vocation.\" Laure Adler",
