    "Summary": "Figure de proue de la nouvelle danse des années quatre-vingt, la chorégraphe Anne Teresa De Keersmaeker n'a cessé depuis de maintenir le corps dansant au centre de ses préoccupations artistiques. Cette analyse met en exergue les éléments qui permettent de définir son style chorégraphique, marqué par une volonté d'assimilation intime et physique des éléments de la composition. Centrée sur le mouvement, ancrée dans un étroit rapport à la musique, la structure compositionnelle met également en valeur une vision exigeante mais éthique de l'interprétation. Ce livre est issu d'une recherche sur le statut de la description, ainsi que son rôle dans l'activité critique et le débat esthétique. L'auteur tente de donner ici au matériau même de la danse l'importance qui lui revient, en alliant étude des textes et analyse des oeuvres composant le répertoire de la compagnie Rosas, de Fase (1982) à Raga for the rainy season (2005).",
