    "Summary": "La danse est une histoire de passeurs. Après les transmissions « en douceur » du XIXe siècle, le XXe apparaît comme sorte de feu d’artifice continu, qui nourrit la création et invente toujours de nouveaux pas, de nouvelles formes, un nouveau rapport au son, au costume, à l’espace scénique, au public, à la lumière, cherchant à voir jusqu’où l’on peut exploiter le corps humain. Les grands chorégraphes dont Gérard Mannoni campe ici les portraits sont les véritables artisans de cette passionnante histoire, illustrée par une sélection de photographies originales.  Avec, par ordre d’apparition dans le livre : Ruth Saint-Denis et Ted Shawn – Michel Fokine – Mary Wigman – Fedor Lopoukhov – Bronislava Nijinska – Kossian Goleizovsky – Jean Börlin – Martha Graham – Leonide Massine – Kurt Jooss – George Balanchine – Frederick Ashton – Leonide Lavrovski – Serge Lifar – Agnes de Mille – Aurel Milloss – Anthony Tudor – Birgit Cullberg – Catherine Dunham – Alwyn Nikolais – Jerome Robbins – Merce Cunningham – Roland Petit – John Cranko – Bob Fosse – Maurice Béjart – Youri Grigorovitch – Kenneth MacMillan – Paul Taylor – Alvin Ailey – Pierre Lacotte – Trisha Brown – John Neumeier – Lucinda Childs – Pina Bausch – Carolyn Carlson – Germaine Acogny – Mats Ek – Jiri Kylian – William Forsythe – Ushio Amagatsu – Jean-Claude Gallotta – Dominique Bagouet – Maguy Marin – Saburo Teshigawara – Angelin Preljocaj – Thierry Malandain – Anne Teresa de Keersmaeker – Jean-Christophe Maillot – Philippe Decouflé – Wim Wandekeybus – Sasha Waltz",
