    "Summary": "Bien que le bouddhisme ne soit pas une religion du Livre, les écritures bouddhiques qui servent de référence aux différentes écoles forment un ensemble monumental. Ces textes de longueurs variées, et issus de traditions différentes, regroupent des sermons attribués au Bouddha, des commentaires sur la Doctrine, des traités de méditation, des poèmes, des échanges philosophiques, des aphorismes... Dans cette anthologie raisonnée, précédemment parue sous le titre Les Fleurs de Bouddha, Pierre Crépon nous propose un parcours passionnant, avec un choix de textes, situés dans leur contexte historique et doctrinal, qui donne à ressentir la saveur de la religion de l'Éveil. L'ensemble forme une synthèse inégalée et très accessible de la littérature fondatrice du bouddhisme, véritable joyau du patrimoine spirituel et culturel de l'humanité.",
