    "Genre": "Religion",
    "Summary": "Ce précieux livre nous révèle la pratique non commune du mahamoudra tantrique de la Lignée Orale Gandèn, que l’auteur a reçue directement de son guide spirituel, Dordjétchang Tridjang Rinpotché. Ce livre explique de façon claire et concise la totalité de la voie spirituelle, depuis les pratiques préliminaires initiales jusqu’aux étapes de réalisation finales du tantra du yoga suprême qui nous permet d’atteindre la pleine illumination au cours de cette vie. En suivant le texte racine du mahamoudra, La Voie principale des conquérants, écrit par le premier Pantchèn Lama, ce livre nous donne des explications extrêmement claires et faciles à comprendre, basées sur l’expérience que l’auteur a acquise au cours de nombreuses années de retraite.",
