    "Original Year Published": "",
    "Edition": "",
    "Genre": "Religion",
    "Summary": "Support de méditation, langage au-delà des mots, le symbole est une voie royale vers l'Eveil. Le bouddhisme tibétain, notamment à travers ses rituels tantriques, a engendré un vocabulaire pictural d'une richesse foisonnante que ce manuel met pour la première fois à disposition du public francophone. Règnes minéral, végétal et animal, objets du quotidien et armes fantastiques, gestes d'amour et artefacts morbides : pour les maîtres du Vajrayana, chaque aspect de notre réalité peut devenir un appel à l'Illumination, pour peu qu'on y éduque notre regard intérieur. Robert Beer, qui pratique depuis plus de trente ans cet art, nous offre à travers près de trois cents articles illustrés un panorama exhaustif de cet aspect fondamental de la spiritualité tibétaine, y compris dans ses doctrines les plus secrètes et transgressives. Au-delà du public bouddhiste, cet ouvrage de référence s'avérera précieux pour tous ceux que fascine le langage symbolique, dont ils trouveront ici une expression surprenante et profonde.",
