    "Summary": "Gynoïdes, sorcières, vampires, chiennes et souris de laboratoire : toutes sont liées à la cyborg de Donna Haraway. Reprenant la liste d'auteurs et autrices de science-fiction féministe citées à la fin du Manifeste cyborg, ïan Larue redéfinit cette figure fondatrice dans la pensée de la philosophe :\"La cyborg, c'est l'esclave noire qui apprend à lire dans un roman d'Octavia Butler ; la jeune fille encapsulée qui, loin de se sentir handicapée, connaît des milliers de connexions ; la fille-orque transportée dans les étoiles. La cyborg est l'hybride suprême, hybride entre une femme réelle et un personnage de roman qui se superpose à elle pour la doter de mille nouvelles possibilités dont celle, fondamentale, de faire éclater capitalisme, famille et patriarcat.\"",
