    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Literary Collections",
    "Summary": "Nous sommes en colère ! Ce fut une révélation. Une épiphanie. Ce sentiment est tellement honni pour les femmes. Nous vivions dans le déni. Nous ravalions le grondement. Déjà le dire. Se l'avouer. L'écrire. Le hurler. Nous sommes en colère. C'est le début de la libération. Geneviève Morand et Natalie-Ann Roy croient que si les femmes manquent de pratique, leur colère est nécessaire. Elles ont décidé de la prendre au sérieux, et de lui ouvrir un espace. Cette colère accumulée, longtemps cachée pour préserver les apparences d'harmonie, se déploie ici comme une puissance politique méconnue. Ce livre rassemble les témoignages, les coups de gueule et les réflexions d'auteures aux réalités variées. Ensemble, elles pulvérisent le mythe de la femme supportant les outrages en silence, comme celui de l'hystérique aux emportements absurdes. Leur indignation s'explique et s'assume ; encore faut-il avoir le courage de les écouter...",
