    "Summary": "Né dans une plantation de coton au sud des Etats-Unis, Robert Leroy Johnson (1911-1938) est aujourd'hui considéré comme l'un des plus grands guitaristes de tous les temps. La légende veut qu'à un carrefour, il ait vendu son âme au diable pour hériter de sa virtuosité. Beau garçon, on lui prête également une réputation de coureur de jupons invétéré et d'écumeur de troquets notoire. Une vie de débauche qui le mènera, à l'âge de 27 ans, à une mort prématurée et voilée de mystère. Le premier d'une longue lignée d'artistes maudits partis trop jeunes... Durant sa courte carrière, Robert Johnson aura seulement laissé une trentaine de titres enregistrés et 3 photos. Mais sa vie, sa musique et sa mort en ont fait une légende pour plusieurs générations de bluesmen et de rockers. Découvrez son histoire... En grands amoureux du blues et de la musique du Delta, Jean-Michel Dupont, par son écriture subtile, et Mezzo, par son graphisme léché, signent un somptueux album comme une ode à la mémoire de ce père du blues qui a inspiré tant de grands musiciens comme Jimi Hendrix, Bob Dylan ou encore les Rolling Stones.",
