    "Summary": "La philosophie du yoga fut exposée pour la première fois dans les Yoga Sûtra, collection d'aphorismes écrits il y a plus de deux mille ans par le sage indien Patanjali. Les Sûtra constituent la première enquête sur le psychisme humain. Patanjali y décrit l'énigme de l'existence humaine et indique comment nous sommes en mesure de nous transformer, grâce à la pratique du yoga. Nous pouvons maîtriser notre mental et nos émotions, et surmonter les obstacles à notre évolution spirituelle afin d'atteindre le but du yoga : kaivalya, la libération vis-à-vis des désirs de ce monde et de nos actions, et l'union avec le divin. Les Sûtra sont commentés par B. K. S. lyengar à la lumière de sa propre sagesse et de son expérience. Il en résulte un ouvrage fort accessible qui sera d'une grande aide aux étudiants de philosophie indienne et aux pratiquants de yoga.",
