    "Summary": "De la ZAD à la Palestine, de la marche pour le climat de New York aux camps de réfugié.es de La Chapelle en passant par le tarmac des aéroports londoniens, Juliette Rousseau, militante altermondialiste, coordinatrice de la Coalition contre la COP 21 en 2015, part à la rencontre de collectifs en lutte contre les rapports de domination liés à la classe, au genre, à la race ou encore à la condition physique et mentale à l'oeuvre dans la société, collectifs qui ont aussi en commun d'interroger l'existence et la reproduction de ces mêmes rapports de domination à l'intérieur des espaces de lutte. A partir de nombreux entretiens, ce livre invite à explorer des formes d'organisation et de solidarité à même de créer les conditions de nouvelles complicités politiques qui ne soient pas aveugles aux oppressions croisées.",
