    "Place of Publication": "",
    "Date Published": "2015/04/22",
    "Year Published": 2015,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "«Un serviteur qui venait l’hiver nous apporter en ville des oeufs frais de notre maison de campagne me raconta qu’il avait vu, au milieu du jardin, devant la maisonnette qui m’appartenait à moi toute seule, “un couple” désireux d’entrer, mais qu’il avait éconduit. Quand il revint la fois suivante, je lui demandai des nouvelles du couple, sans doute parce que l’idée qu’ils avaient dû depuis souffrir du froid et de la faim m’inquiétait : “Où ont-ils bien pu aller ? Eh bien, m’annonça-t-il, ils ne se sont pas éloignés. Alors ils sont toujours devant la petite maison ? Eh bien, ce n’est pas cela non plus : ils se sont complètement transformés, ils sont devenus de plus en plus minces et petits ; ils se sont tant amenuisés qu’ils ont fini par s’effondrer complètement.” Car, un matin qu’il balayait devant la maison, il n’avait plus trouvé que les boutons noirs du manteau blanc de la femme, et, de l’homme, il ne restait plus qu’un chapeau tout bosselé ; mais le sol à cet endroit était encore couvert de leurs larmes glacées.»",
