    "Genre": "",
    "Summary": "Alors qu'elle obtenait des droits formels et une reconnaissance étatique, la \"communauté gay\" aurait peu à peu glissé vers la droite, jusqu'à céder aux sirènes du nationalisme et du racisme. C'est ce paradoxe qu'interroge Alain Naze, non pour le réfuter mais pour en préciser les causes et les conditions. Il revient sur les débats autour du pacs et du \"mariage pour tous\", le combat contre le sida, l'essoufflement des mouvements LGBT, et met à jour la puissante lame de fond de la normalisation gay. En acceptant le modèle hétérocentré, pour des bénéfices limités et très inégalement répartis en son sein, la soi-disant communauté gay a abandonné ce qui précisément la constituait en communauté politique : ses luttes émancipatrices - et s'est rendue perméable aux idées réactionnaires. Pour Alain Naze, il est urgent de renouer avec l'élan révolutionnaire des premiers mouvements de libération homosexuelle et de \"rendre à l'homosexualité son devenir-plébéien, c'est-à-dire de faire en sorte que nous réapprenions à entendre et à désirer les appels au dévoiement, les incitations au détournement, à la dérive\".",
