    "Genre": "Business & Economics",
    "Summary": "Premier du genre à ètre consacré aux spécificités du secteur de la mode, cet ouvrage démontre pourquoi le marketing classique doit ètre mis entre parenthèses pour réussir sur Internet. Mode & Internet propose une analyse des nouveaux enjeux stratégiques qu'Internet impose aux marques de mode. Il démontre comment Internet vient ébranler leurs fondamentaux et esquisse des stratégies de gestion de l'image inédites. L'auteur anticipe également les mutations à venir du système de la mode, engendrées par le développement d'Internet et leurs conséquences sur le management des marques de mode. Les découvertes effectuées tout au long de ce livre révèlent des changements majeurs, dont la portée dépasse de loin le simple univers de la mode et atteint également les autres secteurs. Illustré par des exemples minutieusement choisis, cet ouvrage de référence s'adresse à tous les professionnels de la mode, du luxe et de la gestion des marques.",
