    "Original Year Published": "",
    "Edition": "",
    "Genre": "Medical",
    "Summary": "Why do we feel the way we feel? How do our thoughts and emotions affect our health? Are our bodies and minds distinct from each other or do they function together as parts of an interconnected system?  In her groundbreaking book Molecules of Emotion, Candace Pert provides startling and decisive answers to these and other challenging questions that scientists and philosophers have pondered for centuries.  Her pioneering research on how the chemicals inside our bodies form a dynamic information network, linking mind and body, is not only provocative, it is revolutionary. By establishing the biomolecular basis for our emotions and explaining these new scientific developments in a clear and accessible way, Pert empowers us to understand ourselves, our feelings, and the connection between our minds and our bodies -- body-minds -- in ways we could never possibly have imagined before.  Molecules of Emotion is a landmark work, full of insight and wisdom and possessing that rare power to change the way we see the world and ourselves.",
