    "Summary": "Voyagez à travers l’espace et le temps avec votre prénom ! Au travers d’une approche multiple, riche et innovante, Annie Tranvouëz vous invite à découvrir ou redécouvrir votre saga familiale. Révélez ainsi tous les secrets de vos prénoms ainsi que ceux de votre entourage à travers leur vibration, leur correspondance hébraïque, leur lame du tarot, leur étymologie, les mythologies qui leur sont associées, leur arbre totem... Jouez avec les anagrammes et les dates pour découvrir quels aïeux sont reliés à votre vie et mieux vous ancrer dans votre histoire et votre lignée.Ce livre « mode d’emploi » fournit des outils précieux pour décoder de façon simple et originale les événements marquants survenus sur votre arbre généalogique et en analyser les effets sur votre destinée et votre descendance. En complément des dictionnaires masculin et féminin sur la \"Symbolique des prénoms transgénérationnels\", ce guide vous permettra de faire de votre héritage ancestral, un atout pour un futur rayonnant. [4e de couv.]",
