    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Qu'y a-t-il de commun entre un pré, des vagues, les planètes du Système solaire, des tortues, un sein nu, une fromagerie parisienne, un gorille albinos, une pantoufle dépareillée ? Chacun de ces sujets est pour monsieur Palomar un défi à l'entendement. Chacun suscite en lui, qui les regarde attentivement et tente de les décrire, une cascade de pensées, d'associations d'idées, de questionnements qui, au bout du compte, le renvoient (et le lecteur avec lui) à notre inextinguible désir de connaître, autant qu'à notre ignorance des raisons du monde. Strictement ordonnés selon une logique explicitée par l'auteur dans une note finale, les textes s'entrecroisent, se répondent, formant un tissu chamarré où l'intelligence le dispute à la simplicité apparente, la multiplicité à la légèreté. Monsieur Palomar est l'un des tout derniers livres que Calvino a publiés de son vivant.",
