    "Summary": "Christiane Taubira revient sur les tragiques événements de 2015, raconte comment ils ont été vécus au sommet de l'État, quelles sont les forces obscures qui structurent ce nouveau terrorisme, comment on embrigade de jeunes Français pour les transformer en tueurs... Mais la République possède en elle-même la puissance de riposte nécessaire, une riposte qui ne requiert aucun reniement si elle s'inspire de l'histoire de ses combats. L'auteure appelle les citoyens à trouver dans la culture et la beauté les raisons de défendre avec la plus farouche détermination les valeurs de notre société. Par ces temps troubles et incertains, les paroles de Christiane Taubira élèvent le débat et redonnent espoir à la jeunesse. Paroles d'une femme de conviction, paroles d'une femme libre.",
