    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Tel que l'exprime Emmanuel Carrère dans sa préface, Peter Goss est un maître, l'un des grands pédagogues actuels de la danse et du yoga. Ce livre raconte son histoire, de son enfance et de sa jeunesse sud-africaines marquées par l'apartheid au swinging London des années 1960, jusqu'à ses années parisiennes où il est devenu chorégraphe. Son parcours artistique croise de grandes figures de la danse, classique, jazz ou contemporaine, mais aussi de la culture hippie et du showbiz. Mosaïque d'un artiste qui s'est toujours tenu à distance des modes et des influences du milieu professionnel. Ce livre nous parle de pédagogie, de la bonne distance à tenir entre l'enseignant et l'élève, de la façon d'éprouver son corps et ses mouvements, du savant dosage à déployer entre rigueur et liberté. Il est à mettre entre les mains de tous ceux qui sont engagés dans l'éducation et dans la transmission, au-delà du monde de la danse.",
