    "Summary": "La \"recherche-création\" monte en puissance en France. Erin Manning et Brian Massuni en sont parmi les plus radicaux théoriciens. Ils se demandent dans ce petit ouvrage quelle écologie de l'expérience mettre en place, entre recherche et création, pour nous aider à penser ensemble et à mettre la pensée en acte. En guise de réponses, ils tirent de leurs expériences vingt propositions décoiffantes et enjouées, qui donnent des envies plutôt que des leçons. Ils sèment ainsi des graines d'événements éminemment politiques, dont notre avenir a bien besoin.",
