    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Philosophy",
    "Summary": "English summary: French description: Pensees du corps: se peut-il que le corps pense, qu'il ne soit pas un simple objet de reflexion, mais un sujet de pensee a part entiere?La demarche philosophique est ici confrontee a un corpus de pratiques et d'arts gestuels japonais (danse, theatre, arts martiaux). Une serie d'experiences significatives bousculent les idees recues et poussent le penseur a un renouvellement radical de ses methodes et de ses concepts. En resulte une philosophie de terrain, incarnee et immanente, qui met en lumiere la profonde rationalite du corps. Y compris dans ses deploiements qui d'ordinaire resistent a l'analyse: sensation et action.Nul besoin d'avoir recours a un relativisme culturaliste friand d'exotisme, encore moins a un quelconque irrationalisme. Les pensees du corps dessinent un espace de publicite et d'intelligibilite, une forme d'universalite que chacun peut intimement eprouver et affiner. Loin de constituer un dehors, le corps apparait comme le lieu de production d'un savoir et d'une pensee universellement partageables.",
