    "Summary": "Tueuses, ogresses, sorcières, pédophiles, hystériques, criminelles, délinquantes, furies, terroristes, kamikazes, cheffes de gang, lécheuses de guillotine, soldates, policières, diablesses, révolutionnaires, harpies, émeutières, pétroleuses, viragos, guerrières, Amazones, boxeuses, génocidaires, maricides... Qu'y a-t-il de commun entre toutes ces figures ? Pour le comprendre, il importe d'exhumer, de dénaturaliser, d'historiciser et de politiser la violence des femmes. Telle est l'ambition de cet ouvrage qui propose une approche pluridisciplinaire sur un sujet trop longtemps ignoré des sciences sociales. Cette somme inédite, réunissant des études historiques, anthropologiques, sociologiques, linguistiques et littéraires, révèle combien la violence des femmes est au coeur d'enjeux d'ordre à la fois politique et épistémologique. Penser la violence des femmes, c'est en faire un véritable levier pour considérer autrement la différence des sexes, la violence et, par-delà, l'ordre social.",
