    "Summary": "Le regain actuel de communautarisme religieux et les manifestations d'intégrisme et de fanatisme inquiètent à juste titre. Pourtant la religion ne se réduit pas à cette dimension identitaire et politique. Les grands textes des religions proposent une conception de l'Absolu, de l'homme et du monde, un chemin spirituel, une éthique personnelle, qui visent à aider l'être humain à grandir dans sa propre humanité et à vivre en harmonie avec les autres. Comme ces textes sont parfois noyés dans de vastes ensembles ou difficiles à déchiffrer pour le profane, Télérama et Le Monde des Religions se sont unis pour concevoir une Petite Bibliothèque de spiritualité en douze petits volumes de 48 pages qui offrent la quintessence des textes religieux des grandes traditions du monde. Ces textes ont été choisis et sont présentés par les meilleurs spécialistes dans un souci de pédagogie pour un public non averti. Aux religions classiques (judaïsme, christianisme, islam, hindouisme, bouddhisme, sagesses chinoises), nous avons ajouté deux grands courants spirituels qui se sont développés en Occident en marge du christianisme : l'ésotérisme et la franc-maçonnerie. Croyants et non-croyants trouveront dans ces pages, qui ont contribué à façonner les grandes civilisations, matière à réflexion pour eux-même ou tout simplement pour mieux comprendre notre monde, dont quatre habitants sur cinq se disent religieux.",
