    "Genre": "History",
    "Summary": "Depuis le XVIe siècle, la contemplation de la mer et des plages de Biarritz est source d’inspiration. Chacun à leur manière, Ambroise Paré, Malesherbes, Victor Hugo, Flaubert ou encore Pablo Picasso, ont mis en valeur le rôle essentiel de l’élément marin dans la réputation du site. Bien sûr, sans l’impératrice Eugénie et Napoléon III, Biarritz ne serait jamais devenue une station balnéaire internationale. Grâce à eux, les « têtes couronnées » d’Europe découvrent et vantent la beauté de ce littoral. Pour les accueillir, des équipements touristiques et des demeures de style éclectique sont établis le long d’un front de mer qui participe aussi au charme de Biarritz. Ville singulière du fait d’être construite en amphithéâtre autour de plages nichées au pied de pentes et de falaises attaquées par la lame, Biarritz a toujours considéré la mer comme son propre miroir. En témoigne le succès récent du surf qui rajeunit l’image du lieu tout en plongeant le regard du contemplateur au-delà de la plage, au large de la mer, dans les vagues du puissant océan.",
