    "Date Published": "",
    "Year Published": 2002,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Political Science",
    "Summary": "Le temps n'est plus aux représentations héritées du XIXe siècle, qui opposaient l'idéalisme sacrificiel de l'artiste et le matérialisme calculateur du travail, ou encore la figure du créateur, original, provocateur et insoumis, et celle du bourgeois soucieux de la stabilité des normes et des arrangements sociaux. Dans les représentations actuelles, l'artiste voisine avec une incarnation possible du travailleur du futur, avec la figure du professionnel inventif, mobile, indocile aux hiérarchies, intrinsèquement motivé, pris dans une économie de l'incertain, et plus exposé aux risques de concurrence interindividuelle et aux nouvelles insécurités des trajectoires professionnelles. Comme si, au plus près et au plus loin de la révolution permanente des rapports de production prophétisée par Marx, l'art était devenu un principe de fermentation du capitalisme. Comme si l'artiste lui-même exprimait à présent, avec toutes ses ambivalences, un idéal possible du travail qualifié à forte valeur ajoutée.",
