    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "L'éclairage scénique est un des éléments clé de la réussite d'un spectacle. La lumière est au cœur de l'action théâtrale et les nouvelles technologies permettent de l'utiliser d'une manière toujours plus créative. Pratique de l'éclairage scénique est un ouvrage didactique. L'auteur a mis au point une série d'applications, qui invitent le lecteur à réfléchir sur des problèmes d'éclairage spécifiques : apprendre à voir, comprendre l'impact des effets de lumière sur le jeu des acteurs, utiliser le matériel ad hoc, prendre les bonnes décisions de positionnement des projecteurs, etc. La première partie rappelle les principes fondamentaux de l'éclairage scénique. Dix-sept applications pratiques constituent la seconde partie : objets et acteurs ; aire de jeu et climats ; espace musical ; éclairage minimaliste ; voile magique et changement à vue, etc. Chaque application est traitée selon le même plan : objectif ; mise en scène ; installation éclairage ; nombre de projecteurs utilisés ; synopsis ; problèmes possibles ; analyse des résultats. Cet ouvrage destiné à l'étudiant en art de l'éclairage, lui permettra un apprentissage et une pratique efficaces de l'éclairage scénique.",
