    "Summary": "Mike Steve Donovan, alias le Lieutenant Blueberry est apparu en 1963 dans une série publiée dans Pilote, intitulée Fort Navajo. Très vite, ce personnage buveur, tricheur et pouilleux va s'imposer comme personnage principal de cette série western créée par Jean-Michel Charlier (scénario) et Jean Giraud (dessins). En 1968, les auteurs entreprennent de raconter la jeunesse du héros, durant la guerre de Sécession. Ces pages, sont publiées dans le « Super Pocket Pilote » et nous apprenent notamment comment le héros a obtenu son pseudonyme étrange (\"Blueberry\" veut dire « Myrtille » en Anglais). Jean Giraud se détache ensuite de cette série parallèle qui est donc reprise graphiquement par Colin Wilson, puis par Michel Blanc-Dumont. Lorsque le 10 juillet 1989, Jean-Michel Charlier meurt, c'est François Corteggiani qui reprend le scénario de La Jeunesse de Blueberry. Jean Giraud, quand à lui, se réserve la série principale mais préfère s'entrainer à l'écriture de scénario sur une autre série parallèle qu'il crée avec William Vance au dessin: Marshall Blueberry. Le dernier album de cette série sera dessiné par Michel Rouge tandis que Jean Giraud entame un nouveau cycle de la série principale, intitulé Mister Blueberry et dont il assure le scénario comme le dessin.",
