    "Summary": "In her new book, leading religion scholar Carol Christ provides a comprehensive guide to understanding what has now become the Goddess spirituality movement. A uniquely original voice in religious studies, Christ brings together her personal experience and her academic expertise to explain the principles, practices, and beliefs that have shaped feminist spirituality. Drawing from the fields of history, art, literature, and philosophy, among others, Christ demonstrates the revolutionary effects of worshipping the Goddess: opening ourselves to this new form of divinity can bring us to challenge our most basic assumptions, from how we think about history to how we see ourselves in relation to nature and each other. Elegantly written and ambitious in scope, The Rebirth of the Goddess proves both an engaging historical essay and a testament to the possibilities for change and self-fulfillment.",
