    "Summary": "La COP 21 a suscité un regain d'intérêt en France pour l'écoféminisme dans les milieux militants. Ce mouvement, né dans les années 1980 dans les pays anglo-saxons, a été initié par des femmes faisant le lien entre l'exploitation des ressources naturelles et l'exploitation qu'elles subissaient en tant que femmes. Cette prise de conscience a donné lieu à de nombreuses actions et autant d'écrits écoféministes inconus en France. Cette anthologie, proposée par la philosophe Emilie Hache, permet de découvrir les textes des principales figures de ce mouvement, parmi lesquelles Susan Griffin, Starhawk, Joanna Macy, Carolyn Merchant, certains textes donnant l'impression qu'ils ont été écrits hier, aujourd'hui même, en réaction à la situation qui est la nôtre.",
