    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Toujours plus vite. La croissance est la valeur cardinale des économies modernes et nous sommes tous lancés dans une quête effrénée de performance. C'est aux sentiments de vertige et d'aliénation liés à l'accélération de nos sociétés que le penseur allemand Hartmut Rosa consacre sa réflexion depuis des années. En témoigne son récit d'un voyage en Chine, excursion dans un pays qui est passé de l'époque féodale au capitalisme le plus débridé en quarante ans. Cet ouvrage avance, à travers une série de textes courts et marquants, une solution à la frénésie ambiante : il s'agit d'entrer en résonance avec le monde. Nouveau concept philosophique, la résonance vise à nous faire accéder à une vie meilleure, permettant de trouver un accord entre le monde tel qu'il est et l'existence telle qu'elle mérite d'être vécue. Entrer en résonance avec le monde et les autres, voilà la proposition qui pourrait tous nous amener à découvrir, enfin, la vie bonne.",
