    "Summary": "Si l'accélération constitue le problème central de notre temps, la résonance peut être la solution. Telle est la thèse du présent ouvrage, lequel assoit les bases d'une sociologie de la \"vie bonne\" — en rompant avec l'idée que seules les ressources matérielles, symboliques ou psychiques suffisent à accéder au bonheur. La qualité d'une vie humaine dépend du rapport au monde, pour peu qu'il permette une résonance. Celle-ci accroît notre puissance d'agir et, en retour, notre aptitude à nous laisser \"prendre\", toucher et transformer par le monde. Soit l'exact inverse d'une relation instrumentale, réifiante et \"muette\", à quoi nous soumet la société moderne. Car si nous les recherchons, nous éprouvons de plus en plus rarement des relations de résonance, en raison de la logique de croissance et d'accélération de la modernité, qui bouleverse en profondeur notre rapport au monde sur le plan individuel et collectif. De l'expérience corporelle la plus basique (respiration, alimentation, sensations...) aux rapports affectifs et aux conceptions cognitives les plus élaborées, la relation au monde prend des formes très diverses : la relation avec autrui dans les sphères de l'amitié, de l'amour ou de la politique ; la relation avec une idée ou un absolu dans les sphères de la nature, de la religion, de l'art et de l'histoire ; la relation avec la matière, les artefacts, dans les sphères du travail, de l'éducation ou du sport. Tout en analysant les tendances à la crise — écologique, démocratique, psychologique — des sociétés contemporaines, cette théorie de la résonance renouvelle de manière magistrale le cadre d'une théorie critique de la société.",
