    "Summary": "Entre 1903 et 1912, à l'heure où sa renommée est déjà universelle, Rodin, fort de son expérience, élabore une série de sculptures et de dessins d'une étonnante liberté, connue sous le nom de Mouvements de danse. Cette série constitue l'aboutissement d'une carrière artistique consacrée à l'expression, la plus véridique et authentique possible, du mouvement humain dans son infinie diversité. Le catalogue retrace pas à pas la genèse de ce travail passionnant et restitue le contexte de création si foisonnant qui n'a eu de cesse d'inspirer Rodin. Au fil des pages se découvrent, et se redécouvrent, les figures essentielles d'Isadora Duncan, Loïe Fuller, Vaslav Nijinshi, ou encore des danseuses cambodgiennes. Sensible à la danse dans toutes ses déclinaisons et variations, des plus populaires aux plus audacieuses, Rodin a su donner vie et forme à des oeuvres, à la fois poétiques et puissantes, qui témoignent, plus que jamais, de son génie visionnaire.",
