    "Genre": "",
    "Summary": "L'activite du corps vivant precede notre conscience du corps vecu et produit en nous des gestes involontaires : emotions, vertige, orgasme, reminiscences et douleurs. Sentir son corps vivant nous eveille a une nouvelle connaissance de soi et d'autrui, et exige une attention a soi dans le cours de notre existence, mais aussi a travers une intercorporeite. En s'appuyant sur les neurosciences in vivo et les techniques immersives, l'auteur analyse les apports d'une phenomenologie neurobiologique de l'action, decrit l'ecologie corporelle a partir de l'activation premotrice du vivant, et devoile ces emersions experientielles qui eveillent dans le vivant des capacites inedites. Il nous presente ainsi l'emersiologie, une philosophie du corps qui lie le vivant et le vecu et propose de dynamiser nos sensations profondes pour changer notre schema corporel et notre action dans le monde.",
