    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Swami Prajnanpad est un maître indien (1891-1974) qui est entré dans le coeur et la conscience collective de l'Occident grâce à son approche expérimentale de la spiritualité. Les découvertes de Freud lui ont permis de diagnostiquer les motifs pour lesquels les vérités métaphysiques les plus hautes ne trouvent plus de terrain d'éclosion dans l'expérience de l'homme moderne. Le présent livre veut montrer que l'art et la manière dont Swamiji nous met la vérité sous les yeux, dans l'expérience de tous les jours, s'enracinent dans une profondeur philosophique inouïe, qui rejoint celle d'un Heidegger en Occident ou celle d'un Ibn Arabi ou d'un Molla Sadra en Orient. C'est ainsi une rencontre entre profondeur et simplicité.",
