    "Summary": "\"Écrivain de la Shoah et de l'exil, Edgar Hilsenrath livre avec Terminus Berlin son ultime roman. Fidèle à son humour, il raconte une nouvelle fois avec dérision le destin d'un alter ego littéraire qui, près de trente ans après avoir quitté l'Europe et ses fantômes, retrouve son pays natal. Mais Lesche, traumatisé par son expérience du ghetto, peine à trouver sa place dans un Berlin marqué par le consumérisme et la chute du Mur : la solitude et la résurgence glauque du fascisme forment la trame de ce roman lapidaire, ironique, publié en Allemagne en 2006. Après l'avoir écrit, Edgar Hilsenrath décida que son oeuvre était close. Il n'a plus écrit depuis.\"--Résumé de l'éditeur.",
