    "Genre": "Art",
    "Summary": "Taking that ambiguous thing we call \"the exhibition\" as a critical medium, artists have often radically rethought conventional forms of exhibition making. The Artist as Curator: An Anthology, born out of a series of essays originally published in Mousse, surveys seminal examples of such artist-curated exhibitions from the postwar to the present, examined by the world's foremost curators and illustrated with rare documents and illustrations. Artists featured include the Avant-Garde Argentinian Visual Artists Group; Mel Bochner; Marcel Broothaers; John Cage; Judy Chicago, Miriam Schapiro and the CalArts Feminist Art Program; Collaborative Projects Inc. (Colab); Liam Gillick and Philippe Parreno; Group Material; Richard Hamilton and Victor Pasmore; David Hammons; Martin Kippenberger; Mark Leckey; Hélio Oiticica; Walid Raad and Akram Zaatari; Martha Rosler; and Andy Warhol, among other examples drawn from around the globe.",
