    "Edition": "",
    "Genre": "Performing Arts",
    "Summary": "- First book ever on this international choreographer and his company Ultima Vez- \"Vandekeybus brought into focus a whole new genre of modern dance... Combat rolls, breakneck sprints and savagely wrestled duets became the defining vocabulary of a new generation.\" The Guardian- In 2016, Wim Vandekeybus' company Ultima Vez celebrates its 30th birthday In 2016, Wim Vandekeybus' company Ultima Vez celebrates its 30th birthday. Never before has his oeuvre been recorded in a book. Until now. This extraordinary book is a visual trip through the most powerful images from his repertoire, a quest for the ideas and themes that inspire him. It also contains unpublished texts, notes and scripts from his shows and films. A number of compagnons de route, such as David Byrne, Mauro Pawlowski, and Peter Verhelst, offer a personal textual contribution. Text in English, French, and Dutch.",
