    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Science",
    "Summary": "Dr. Michael D. Gershon's groundbreaking work clearly demonstrates that the human gut actually has a brain of its own. This remarkable scientific breakthrough offers fascinating proof that \"gut instinct\" is biological, a function of the second brain.  An alarming number of people suffer from heartburn, nausea, abdominal pain, cramps, diarrhea, constipation, or related problems. Often thought to be caused by a \"weakness\" of the mind, these conditions may actually be a reflection of a disorder in the second brain. The second brain, located in the bowel, normally works smoothly with the brain in the head, enabling the head-brain to concentrate on the finer pursuits of life while the gut-brain attends to the messy business of digestion. A breakdown in communication between the two brains can lead to stomach and intestinal trouble, causing sufferers great abdominal grief and--too often--labeling them as neurotic complainers.  Dr. Gershon's research into the second brain provides understanding for those who suffer from gut-related ailments and offers new insight into the origin, extent, and management.  The Second Brain is the culmination of thirty years of research. It is an extraordinary contribution to the understanding of gastrointestinal illnesses, as well as a fascinating glimpse into hoe our gut really works.",
