    "Genre": "Psychology",
    "Summary": "What has happened to regional experiences that identify and shape culture? Regional foods are disappearing, cultures are dissolving, and homogeneity is spreading. Anthropologist and award-winning author of The Last Word: Women, Death, and Divination in Inner Mani, C. Nadia Seremetakis brings together essays by five scholars concerned with the senses and the anthropology of everyday life. Covering a wide range of topics—from film to food, from nationalism to the evening news—the authors describe ways in which sensory memories have preserved cultures otherwise threatened by urbanism and modernity.  The contributors are Susan Buck-Morss, Allen Feldman, Jonas Frykman, C. Nadia Seremetakis, and Paul Stoller.  C. Nadia Seremetakis is Advisor to the Minister of Public Health in Greece and visiting professor at the National School of Public Heath in Athens. She is the author of The Last Word: Women, Death, and Divination in Inner Mani, available from the University of Chicago Press.",
