    "Summary": "Un grand nombre de personnes ont le désir compatissant d'aider les autres, mais peu comprennent comment faire cela efficacement dans la vie quotidienne. Les bodhissattvas sont des amis du monde et ont une telle compassion qu'ils sont capables de transformer toutes leurs activités quotidiennes pour que ce soit utile aux autres. La voie du bodhissattva a été expliquée avec splendeur dans le texte classique du Vllle siècle du maître bouddhiste Shantidéva Le Guide du mode de vie du bodhissattva. Dans ce commentaire de l'oeuvre de Shantidéva, Vénérable Guéshé Kelsang Gyatso Rinpotché dévoile l'efficacité et la profondeur de ce merveilleux poème pour le rendre applicable à notre époque.",
