    "Genre": "",
    "Summary": "Uchronia' is a project initiated by the artists Annie Vigier and Franck Apertet (les gens d?Uterpan) in 2014, which emanates from the analysis of individual or collective attitudes and behaviors produced in the public space of a given city. The word uchronia, used among others by the French philosopher Charles Renouvier in his book 'Uchronie, l?utopie dans l?histoire' (1876), means 'non-time', that is, a time that doesn?t exist.00In response to the increasing transformation of public spaces into functional areas toward which individuals are guided to fulfill a given activity, the two artists call upon citizens to become uchronists, to infiltrate public life with physical modules coming from daily behaviors, synchronized and adjusted according to context. Contrary to flash mobs or performances, these actions don?t address spectators. Passersby are accidentally witnesses, attentive or not, of these presences and gestures that maintain the formal appearance of normality.0.",
