    "Title": "Un boycott légitime",
    "Original Title": "",
    "Subtitle": "pour le BDS universitaire et culturel de l'État d'Israël",
    "Series": "",
    "Volume": "",
    "Author": "Eyal Sivan, Armelle Laborie",
    "Author (Last, First)": "Sivan, Eyal",
    "Illustrator": "",
    "Narrator": "",
    "Translator": "",
    "Photographer": "",
    "Editor": "",
    "Publisher": "La Fabrique éditions",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 2016,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\"Pour l'État d'Israël, la principale source d'exportation vers l'Occident n'est pas faite de mandarines ou d'avocats, ni même d'armement ou de systèmes sécuritaires : l'essentiel, c'est la promotion d'une image, celle de \"énergie créative\" pour tout ce qui touche à la culture. \"Les produits israéliens comme la littérature, la musique, la danse, le cinéma, l'art, la gastronomie, la science et les technologies, l'architecture et l'histoire sont des domaines culturels susceptibles de toucher les publics cibles, particulièrement en Europe\" explique un ex-député du parti de gauche Meretz. Or cette vitrine culturelle, comme le prestige international de l'université israélienne, masque une tout autre réalité : les liens entre cette université et l'institution militaire, le rôle de l'université dans la recherche de nouveaux outils de combat et de renseignement, la discrimination des étudiants palestiniens, l'absence de protestation contre les guerres menées à Gaza ... Et l'évidence que les écrivains, artistes et cinéastes du soi-disant Camp de la paix, d'Amos Oz à Amos Gitaï ou David Grossman, ne sont que des dissidents officiels tout à fait inoffensifs. C'est cette réalité-là qui explique le succès exponentiel du boycott académique et culturel dans le monde entier. Ce boycott n'est ni un obstacle au dialogue, ni un frein à l'action d'une \"gauche sioniste\" muette et paralytique. Il est un mode de résistance pacifique et parfaitement légitime.\"--Page 4 of cover.",
