    "Summary": "Le commerce du luxe connaît une expansion sans précédent. La concentration des grandes marques au sein de quelques firmes et l'enrichissement accéléré de pays comme la Chine ont profondément modifié le marché du luxe. Après Un ethnologue à l'Assemblée, voici Un ethnologue au pays du luxe. Marc Abélès nous invite dans ce livre à explorer le monde du luxe, ses produits, son économie mais aussi sa symbolique. Car le luxe est une quête, celle de l'exceptionnel, de ce qui n'a pas de prix. Il porte la marque de l'excès et de la \"folle exubérance\". En suivant les routes du luxe, Marc Abélès cherche ici à comprendre cette emprise quasi magique de l'objet de luxe, la fascination qu'il exerce, les échanges entre les cultures qu'il instaure, ses modes de circulation et d'appropriation. Mais la croissance industrielle fait peser sur ce marché la menace de l'uniformisation et de la banalisation. Le luxe doit sans cesse se réinventer. Comment le fera-t-il ? En nouant une alliance inédite avec le marché de l'art contemporain. Une exploration inédite du luxe, entre fascination et finance, créativité et industrie.",
