    "Genre": "",
    "Summary": "Dans le débat public, être \"décolonial\" est une infamie. Dans les universités, dans les partis de gauche et d'extrême gauche, les syndicats, les associations féministes, partout on traque une \"pensée décoloniale\" infiltrée et funeste pour le vivre-ensemble. Dans ce livre, Françoise Vergès élucide l'objet du scandale. Le féminisme décolonial révèle les impensés de la bonne conscience blanche ; il se situe du point de vue des femmes racisées : celles qui, travailleuses domestiques, nettoient le monde ; il dénonce capitalisme foncièrement racial et patriarcal. Ces pages incisives proposent un autre récit du féminisme et posent les questions qui fâchent : quelles alliances avec les femmes blanches ? Quelle solidarité avec les hommes racisés ? Quelles sont les premières vies menacées par le capitalisme racial ? Pourquoi les néofascismes s'attaquent-ils aux femmes racisées ? Ce livre est une invitation à renouer avec la puissance utopique du féminisme, c'est-à-dire avec un imaginaire à même de porter une transformation radicale de la société.",
