    "Title": "Une histoire des sexualités",
    "Original Title": "",
    "Subtitle": "",
    "Series": "",
    "Volume": "",
    "Author": "Sylvie Steinberg",
    "Author (Last, First)": "Steinberg, Sylvie",
    "Illustrator": "",
    "Narrator": "",
