    "Photographer": "",
    "Editor": "",
    "Publisher": "PUF",
    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 2018,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Accessible et riche, inventive sur le plan de la recherche documentaire comme dans la réflexion, cette histoire des sexualités propose de retracer les grandes étapes et les évolutions des normes et des mentalités. \"Fait social total\", la sexualité est à l'intersection de plusieurs types d'approches historiques : sociales, anthropologiques, culturelles, linguistiques. Sous les projecteurs croisés de la démographie historique, de l'anthropologie culturelle et de l'histoire sociale, son histoire pose l'hypothèse que les comportements humains qui lui sont liés -fantasmes et représentations, pratiques érotiques et procréatives - sont eux aussi des objets qu'il s'agit d'étudier sans les détacher des autres pans de l'histoire humaine. Mais on ne saurait aujourd'hui s'intéresser à la sexualité sans y faire également entrer des outils forgés dans le champ de l'histoire du genre. Plus que jamais, la sexualité est devenue un domaine incontournable en histoire.",
