    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 1995,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Health & Fitness",
    "Summary": "This comprehensive guide introduces Body-Mind Centering, the internationally recognized field pioneered by dancer and occupational therapist Bonnie Bainbridge Cohen. Devoting thirty-five years to a systematic investigation of the relations between bodily experience and the anatomical maps of science, Bainbridge Cohen independently discovered many of the principles that underlie Feldenkrais work, cranial osteopathy, Rolfing, dance therapy, and Zero Balancing. Experienced BMC practitioner Linda Hartley demonstrates the basic philosophy and key elements of Body-Mind Centering. Drawing on animal and infant movements, she takes readers through the wondrous realms of Bainbridge Cohen’s pantheon—from the 'minds' of the skeletal and muscular systems to the quite different inner lives of digestive, lymphatic, urinary, respiratory, vocal, circulatory, endocrine, and reproductive organs. Her choreography ultimately brings us into the states of consciousness of skins, cells, blood, fat, cerebrospinal fluid, nervous system, and brain. Hartley’s explorations of the images, feelings, sensations, and intuitions of the diverse organs and cells lead to exercises that gently guide students in ways of discovering and integrating their bodies’ multidimensional aspects.",
