    "Genre": "Poetry",
    "Summary": "A collection with a feminist ethos that cuts across race, gender identity, and sexuality. Creative activists have reacted to the 2016 Presidential election in myriad ways. Editors Danielle Barnhart and Iris Mahan have drawn on their profound knowledge of the poetry scene to put together an extraordinary list of poets taking a feminist stance against the new authority. What began as an informal collaboration of like-minded poets--to be released as a handbound chapbook--has grown into something far more substantial and ambitious: a fully fledged anthology of women's resistance,with a portion of proceeds supporting Planned Parenthood and the Center for Reproductive Rights. Representing the complexity and diversity of contemporary womanhood and bolstering the fight against racism, sexism, and violence, this collection unites powerful new writers, performers, and activists with established poets. Contributors include Denice Frohman, Elizabeth Acevedo, Sandra Beasley, Jericho Brown, Mahogany L. Browne, Danielle Chapman, Tyehimba Jess, Kimberly Johnson, Jacqueline Jones LaMon, Maureen N. McLane, Joyce Peseroff, Mary Ruefle, Trish Salah, Patricia Smith, Anne Waldman, and Rachel Zucker.",
