    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Gita S. Lyengar, fille du yogi mondialement connu B. K. S. lyengar, est considérée comme la plus grande yogini de notre époque. Dans cet ouvrage spécifiquement destiné aux femmes, elle décrit un large choix de postures, illustrées de plus de deux cents photographies, réputées pour leur valeur physique et thérapeutique, les techniques respiratoires du yoga ainsi que celles de la méditation. Dans une langue simple et concise et à l'aide d'explications claires, elle permet à l'élève d'avancer d'un plan purement corporel à un niveau de conscience plus élevé. A l'encontre de l'idée répandue selon laquelle le yoga ne serait pas fait pour les femmes, elle montre que celles-ci peuvent le pratiquer comme toute autre discipline.",
