    "Original Year Published": "",
    "Edition": "",
    "Genre": "Fiction",
    "Summary": "Anna n'est pas qu'une femme, qu'un splendide spécimen du sexe féminin, c'est une femme dotée d'un sens moral entier, tout d'un bloc, prédominant: tout ce qui fait partie de sa personne est important, a une intensité dramatique, et cela s'applique aussi bien à son amour.Elle n'est pas, comme Emma Bovary, une rèveuse de province, une femme désenchantée qui court en rasant des murs croulants vers les lits d'amants interchangeables. Anna donne à Vronski toute sa vie.Elle part vivre avec lui d'abord en Italie, puis dans les terres de la Russie centrale, bien que cette liaison « notoire » la stigmatise, aux yeux du monde immoral dans lequel elle évolue, comme une femme immorale. Anna scandalise la société hypocrite moins par sa liaison amoureuse que par son mépris affiché des conventions sociales.Avec Anna Karénine, Tolstoï atteint le comble de la perfection créative.Vladimir Nabokov.Préface d'André Maurois.Commentaires de Marie Sémon.",
