    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Poetry",
    "Summary": "L'Ouvroir de Littérature Potentielle oeuvre \"sous contrainte\", la chose est connue. Mais si beaucoup a été écrit sur son travail, jamais autant de textes, aussi divers, n'ont été rassemblés en un volume unique. Il y avait quelque gageure à oser tenter un tel tri : en près de cinq millénaires (car l'Oulipo compte chaque année d'activité pour un siècle), les trente-cinq membres du groupe, et non des moindres (d'ailleurs, il n'y a pas de moindre en son sein), ont créé des milliers d'oeuvres oulipiennes. Mais le défi a été relevé. Dans cet ouvrage, très complet, les Oulipiens parlent de la ville, de l'amour, des livres, du souvenir. Ces thématiques rendent visibles une cohérence nouvelle, un goût commun pour le jeu virtuose, la mémoire collective et l'humour. Pour le plus grand plaisir du lecteur, la langue, comme le poème a ici kekchose d'extrême.",
