    "Genre": "Fiction",
    "Summary": "Ce livre, les plus proches des amis de Marcel Proust en parlaient depuis quelque temps avec une discrétion passionnée et les lecteurs du \" Figaro \" eurent ici même plus d'une fois la fortune d'en connaître des extraits. Il forme la première partie d'une trilogie, et son titre Du côté de chez Swann, orienté, libre et fécond comme un départ pour la promenade, est la si violente et lumineuse projection d'une intelligence et d'une sensibilité qu'en le lisant on entend une voix profonde et révélatrice, plus encore qu'on n'accomplit l'habituel travail visuel et spirituel de la lecture, et qu'après l'avoir refermé, et avant de la reprendre, l'écho de cette voix se prolonge, évoquant la présence de l'auteur pour ceux qui le connaissent, et, pour les autres, capables de la reconstituer.",
