    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Political Science",
    "Summary": "Named one of Vogue's \"Most Anticipated Books of 2019\"  From three of the organisers of the International Women's Strike US: a manifesto for when \"leaning in\" is not enough. Unaffordable housing, poverty wages, healthcare, climate change, border policing; not the issues you ordinarily hear feminists talking about. But don't these issues impact the vast majority of women globally? Taking as its inspiration the new wave of feminist militancy that has erupted globally, this Manifesto makes a simple but powerful case: Feminism shouldn't start--or stop--with seeing women represented at the top of society. It must start with those at the bottom, and fight for the world they deserve. And that means targeting capitalism. Feminism must be anti-capitalist, eco-socialist and anti-racist. This is a manifesto for the 99%.",
