    "Edition": "",
    "Genre": "Fiction",
    "Summary": "La jeune Berlinoise qui a rédigé ce journal, du 20 avril 1945 - les Soviétiques sont aux portes - jusqu'au 22 juin, a voulu rester anonyme, lors de la première publication du livre en 1954, et après. À la lecture de son témoignage, on comprend pourquoi. Sur un ton d'objectivité presque froide, ou alors sarcastique, toujours précis, parfois poignant, parfois comique, c'est la vie quotidienne dans un immeuble quasi en ruine, habité par des femmes de tout âge, des hommes qui se cachent - vie misérable, dans la peur, le froid, la saleté et la faim, scandée par les bombardements d'abord, sous une occupation brutale ensuite. S'ajoutent alors les viols, la honte, la banalisation de l'effroi.",
