    "Genre": "Fiction",
    "Summary": "La 4ème de couv. indique :\"Chaque femme porte en elle une force naturelle, instinctive, riche de dons créateurs et d'un savoir immémorial. Mais la société et la culture ont trop souvent muselé cette \" Femme sauvage \", afin de la faire entrer dans le moule réducteur des rôles assignés. Psychanalyste et conteuse, fascinée par les mythes et les légendes, auteur également du Jardinier de l'Eden, Clarissa Pinkola Estés nous propose de retrouver cette part enfouie, pleine de vitalité et de générosité, vibrante, donneuse de vie. A travers des \" fouilles psycho-archéologiques \" des ruines de l'inconscient féminin, en faisant appel aux traditions et aux représentations les plus diverses, de la Vierge Marie à Vénus, de Barbe-Bleue à la petite marchande d'allumettes, elle ouvre la route et démontre qu'il ne tient qu'à chacune de retrouver en elle la Femme sauvage. Best-seller aux Etats-Unis, ce livre exceptionnel est destiné à faire date dans l'évolution contemporaine de l'identité féminine.\"",
