    "Summary": "La vie est une histoire racontée par un idiot, pleine de fureur et de bruit, et qui ne signifie rien.Macbeth, acte V, scène vHamlet, Othello, Macbeth, une mème histoire de chair, d'amour et de mort. Des mains sont rougies d'un sang innocent qu'aucun parfum d'Arabie ne lavera. Les spectres et les sorcières mènent la danse. Ils incitent Hamlet à tuer son oncle, meurtrier de son père et amant de sa mère; Othello son épouse qu'il croit infidèle; Macbeth son roi, pour prendre la couronne. Le cauchemar de chacun devient réalité. « Il y a quelque chose de pourri dans le royaume du Danemark », en Ecosse et à Venise. Les trois héros ont provoqué le destin. Il les écrasera, faisant périr aussi Ophélie et Desdémone, l'amour et la pureté. Le génie de Shakespeare est de dire toute l'incertitude de la condition humaine, ses rèves, sa gloire, sa petitesse.Edition présentée et commentée par Yves Florenne.",
