    "Summary": "Saul Karoo is a successful Hollywood script doctor, a fixer of flawed films. He is fifty, overweight, a heavy drinker and chain smoker. He is at an age when things break down, but he has no health insurance. His separation from his wife, Dianah, has become another form of marriage. His relationship with his son, Billy, a college student, is one of pure avoidance. He cannot free himself from the grip of the powerful producer Jay Cromwell. The unnecessary scenes that he has effortlessly cut from other people's screenplays seem to threaten his own life. But Saul Karoo is the ultimate fixer. He must find an emotional and intellectual solution - one that may in the end prove more deadly than the problems it was intended to solve.",
