    "Summary": "J'écris de chez les moches, pour les moches, les frigides, les mal baisées, les imbaisables, toutes les exclues du grand marché à la bonne meuf, aussi bien que pour les hommes qui n'ont pas envie d'ètre protecteurs, ceux qui voudraient l'ètre mais ne savent pas s'y prendre, ceux qui ne sont pas ambitieux, ni compétitifs, ni bien membrés.Parce que l'idéal de la femme blanche séduisante qu'on nous brandit tout le temps sous le nez, je crois bien qu'il n'existe pas.V.D.En racontant pour la première fois comment elle est devenue Virginie Despentes, l'auteur de Baise-moi conteste les discours bien-pensants sur le viol, la prostitution, la pornographie. Manifeste pour un nouveau féminisme.",
