    "Summary": "Owen Brynmor ne comptait plus retourner dans la Pennsylvanie profonde de son enfance, pays provincial et rétrograde partagé entre ploucs américains et amish rigoristes. Mais à peine engagé comme reporter au journal local, il décroche un scoop : le retour du Démon de Blue Ball, cette bête mystérieuse qui jadis ravagea la région. Son enquête l'amène à exhumer la légende du Kornwolf, ce loup-garou qui hanta l'Europe du XVIIe siècle. Mais où s'incarne vraiment le Mal ? Dans un monstre quelconque, ou parmi les humains qui le pourchassent ? Dans son dernier roman achevé, Tristan Egolf renoue avec la veine truculente et enragée du Seigneur des porcheries. Tout en pastichant la littérature fantastique, il nous offre une peinture vengeresse d'une Amérique dégénérée, dont seuls les parias méritent d'être sauvés. Il est impossible d'oublier la puissance visionnaire de cette prose torrentielle.",
