    "Genre": "Fiction",
    "Summary": "\" Ce sont les premières heures de ma présence en Inde, et je ne sais pas dominer la bête assoiffée, en moi emprisonnée, comme en cage. Je persuade Moravia de faire du moins quelques pas près de l'hôtel et de respirer quelques bouffées de cet air, d'une première nuit en Inde... \" En 1961, Pasolini fit un voyage avec Alberto Moravia et Elsa Morante. Le livre intensément lyrique qu'il en rapporta n'est pas vraiment un récit, mais une \" odeur \" respirée au cours de ses errances nocturnes. Les visions de l'extrême misère, les spectacles d'une étrange spiritualité sont pour lui comme autant d'étapes d'une descente au sein d'une humanité primitive, moins éloignée qu'on ne pourrait le croire du décor des Ragazzi ou d'Une vie violente.",
