    "Summary": "Erasme disait qu'on ne naît pas homme mais qu'on le devient. Un véritable art de vivre est requis pour tenir debout, maintenir le cap et trouver la joie là où elle se donne. Ce sont ces grands chantiers de l'existence qu'Alexandre Jollien explore ici. Il revisite ainsi quelques-unes des grandes questions de la philosophie : le sens de la souffrance, l'art de la rencontre, le goût de l'autre, pour tenter d'esquisser un chemin de liberté et de légèreté. Il puise avec humour et sincérité dans son expérience de personne handicapée comme dans la tradition philosophique des outils pour savourer l'existence avec gourmandise. Le texte est suivi d'un entretien inédit avec Bernard Campan : \"La pratique spirituelle, un autre nom pour le métier d'homme\".",
