    "Summary": "L'intestin est un acteur cle de notre sante des etudes scientifiques recentes ont demontre qu'il se comporte comme un deuxieme cerveau et joue un role determinant dans de nombreuses pathologies: migraines, surpoids, stress, insomnies, problemes cutanes, infections diverses... Cet ouvrage tres documente presente le role du systeme digestif, sa relation avec les autres organes du corps et les differents troubles qui lui sont lies. Par son approche axee sur les traitements non medicamenteux, il offre des solutions a la portee de tous (respiration, alimentation, relaxation...) et des questionnaires-sante, afin que chacun puisse faire un bilan personnel et preventif.",
