    "Summary": "Donnez-vous enfin la permission d'exister et de créer. Avez-vous renoncé à vos rêves d'enfant et d'adolescent ? Vous laissez-vous influencer par vos peurs et votre raison ? Pour Julia Cameron, plus l'écart se creuse entre notre Moi créateur et notre Moi rationnel, plus notre goût de vivre s'émousse. En levant nos blocages, nos mauvaises habitudes et nos inhibitions, on libère une vitalité et une créativité inestimables. Grâce à un programme en douze semaines et de nombreux exercices, Libérez votre créativité montre le chemin de l'élan créateur et libérateur. Un livre précieux pour devenir enfin la personne que vous avez toujours rêvé d'être.",
