    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Entre un jeune Californien du XXIe siècle et une fillette allemande des années 1940, rien de commun si ce n'est le sang. Pourtant, de l'arrière-grand-mère au petit garçon, chaque génération subit les séismes politiques ou intimes déclenchés par la génération précédente. Monstrueuses ou drôles, attachantes ou désespérées, les voix de Sol, Randall, Sadie et Kristina - des enfants de six ans dont chacun est le parent du précédent - racontent, au cours d'une marche à rebours vertigineuse, la violence du monde qui est le nôtre, de San Francisco à Munich, de Haïfa à Toronto et New York. Quel que soit le dieu vers lequel on se tourne, quelle que soit l'époque où l'on vit, l'homme a toujours le dernier mot, et avec lui la barbarie. C'est contre elle pourtant que s'élève ce roman éblouissant où, avec amour, avec rage, Nancy Huston célèbre la mémoire, la fidélité, la résistance et la musique comme alternatives au mensonge.",
