    "Genre": "",
    "Summary": "\" Vous allez connaître le grand bonheur de lire ce livre pour la première fois. \" Rainer Maria Rilke. Lettres à un jeune poète. Considéré comme le plus grand poète et romancier danois, Jens Peter Jacobsen mourut en 1885 à l'âge de trente-huit ans, laissant plusieurs recueils de poèmes et deux romans dont le chef-d'œuvre Madame Marie Grubbe. Ce livre, empreint du style et de la sensibilité baroques, est largement inspiré de la véritable histoire de Marie Grubbe qui scandalisa la Cour du Danemark par ses nombreux mariages. Après une jeunesse heureuse et choyée, Marie épouse le demi-frère du roi. Vite délaissée par ce dernier, elle s'enfuit. Son père conclut un nouveau mariage avec un propriétaire mais elle s'éprend irrésistiblement d'un fils de paysan. Bien que sous-titré dans l'édition danoise \" Images du XVIIe siècle \", il ne s'agit pas à proprement parler d'un roman historique car l'auteur s'attache avant tout à la psychologie des personnages et à la langue danoise, qu'il a portée à la perfection.",
