    "Summary": "Danseuse, chorégraphe et professeur, Martha Graham (1894-1991) n'a cessé de se battre pour un art nouveau. De ses premiers spectacles à ses grandes créations, elle se raconte dans cette autobiographie achevée quelques jours avant sa mort et retrace le parcours d'une vie tout entière dédiée à la danse. Ses souvenirs sont ceux d'une grande dame du XXe siècle, véritable \"mémoire de la danse\" nourrie de ses rencontres avec les artistes et les célébrités de ce monde, autant que de ses confrontations avec ses élèves. De chacun d'eux elle parle avec tendresse et pertinence, dressant ainsi d'elle-même, en creux, le portrait d'une femme exigeante et opiniâtre.",
