    "Date Published": "",
    "Year Published": 1995,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "\" De tous mes livres peu me sont indispensables : deux sont toujours parmi les choses à ma portée, où que je sois. Ici même ils sont près de moi. Ce sont : la Bible et les livres du grand poète Jens Peter Jacobsen. A propos, connaissez-vous ses œuvres ? Procurez-vous le petit volume Six nouvelles et le roman Niels Lyhne. Commencez par la première nouvelle, qui a pour titre Mogens. Un monde vous saisira : le bonheur, la richesse, l'insondable grandeur d'un monde. ... Lisez ensuite l'admirable livre sur le destin et les passions de Marie Grubbe, les lettres de Jacobsen, ses pages de Journal, ses fragments et enfin ses vers qui vivent en résonances infinies... Vivez quelque temps dans ces livres ; mais surtout aimez-les. Cet amour vous sera mille et mille fois rendu, et quoi que devienne votre vie, il traversera, j'en suis certain, le tissu de votre être, comme une fibre essentielle, mêlée à celles de vos propres épreuves, de vos déceptions et de vos joies. \"",
