    "Edition": "",
    "Genre": "Fiction",
    "Summary": "Oh les beaux jours : pièce en deux actes pour deux personnages, écrite en anglais entre 1960 et 1961. Traduite en français par l'auteur en 1962. La première représentation, avec Madeleine Renaud dans le rôle de Winnie et Jean-Louis Barrault dans celui de Willie, eut lieu en septembre 1963 au Festival du Théâtre de Venise, où elle remporta un immense succès. Fin octobre 1963, la pièce fut reprise par ces mêmes acteurs à Paris au Théâtre de l'Odéon. Elle a figuré ensuite durant de très nombreuses années au répertoire de la Compagnie Renaud-Barrault. La traduction française de l'auteur est parue aux Éditions de Minuit en 1963. Pas moi : pièce en un acte pour une bouche, écrite en anglais, traduite en français par l'auteur en 1973.",
