    "Place of Publication": "",
    "Date Published": "",
    "Year Published": 1985,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "Poetry",
    "Summary": "C'est peut-être le recueil où apparaît avec le plus d'ampleur le thème essentiel de l'œuvre d'Henri Michaux : le refus de la réalité quotidienne - «sa défaite : le quotidien» - et la revendication d'«autre chose». Cette autre chose souvent proposée, on le sait, sous la forme de situations imaginaires qui témoignent chez le poète du constant besoin d'inventer. Tantôt avec les couleurs apparemment légères de l'humour, tantôt avec celles d'une angoisse existentielle que l'humour ne parvient plus à cacher. Toujours, il est vrai, d'un «lointain intérieur», c'est-à-dire de ces confins du subconscient que Michaux ne se lasse pas d'explorer.",
