    "Genre": "Art & Architecture",
    "Summary": "En août 1948 paraît à Montréal un manifeste signé par une bande de jeunes artistes, qui fait vite scandale : c'est  Refus global . Celui qui l'a rédigé, le doyen du groupe, Paul-Émile Borduas, est démis peu après de son poste de professeur à l'École du meuble. Et, face aux réactions hostiles que suscite leur prise de position, plusieurs des signataires vont préférer poursuivre leur carrière à l'étranger, dont Borduas lui-même.  Refus global  n'était pas un accident de parcours : les écrits de Borduas réunis ici démontrent l'ampleur de la culture et la profondeur de réflexion à l'origine de ce rententissant appel à la libération.",
