    "Date Published": "2012/09/20",
    "Year Published": 2012,
    "Original Date Published": "",
    "Original Year Published": "",
    "Edition": "",
    "Genre": "",
    "Summary": "Qu'est-ce qu'être « Beat »? « Sur les origines d'une génération » raconte la naissance de la « Beat Generation », – dont Kerouac est un porte-parole majeur –, depuis la fin des années 50, où beat signifiait « pauvre, fauché, à la dérive, dans la dèche » jusqu'à « sa reconnaissance officielle » à l'époque où il écrit ce texte (1959) : « Beat Generation est devenu le slogan d'une révolution de moeurs en Amérique ». Dans ses chroniques pour la revue Escapade entre avril 1959 et juin 1960, recueillies sous le titre Le dernier mot , il aborde ses sujets de prédilection – la littérature, le jazz, le voyage, la route, le bouddhisme, le zen... Une écriture au rythme échevelé, syncopé, hypnotique; une lecture souvent drôle : « De là je suis allé à Paris, où il ne se passait rien si ce n’est que la plus belle fille du monde n’aimait pas mon sac à dos et avait rendez-vous avec un type à petite moustache debout une main dans la poche et un sourire méprisant aux lèvres devant les cinémas de nuit de Paris. » (Le dernier mot, août 1960) Ces textes sont extraits du recueil Vraie blonde, et autres (Folio n°3904).",
