    "Genre": "Fiction",
    "Summary": "Tristan et Iseut, les amants de Cornouailles, unis pour avoir bu le philtre d'amour. Cette légende médiévale a marqué plus que nulle autre l'imagination et la sensibilité de l'Europe entière. Elle apparaît d'abord, fragmentaire et morcelée, dans des poèmes français du XIIe siècle, dont le roman de Béroul est sans doute le plus ancien. Nous en avons conservé la partie centrale : les amants épiés et finalement surpris, leur fuite et leur errance dans la forêt du Morrois, comment le roi Marc les y trouve endormis, séparés par l'épée de Tristan, le serment ambigu prêté par Iseut. Pour découvrir l'ensemble de la légende dans les textes originaux et leur traduction, on se reportera au volume de la collection Lettres gothiques : Tristan et Iseut. Les poèmes français. La saga norroise.",
