    "Genre": "",
    "Summary": "Vous pouvez être ce que vous voulez être est un guide concis pour tirer le meilleur de soi-même, une \" bible \" de poche qui permettra aux timides talentueux de penser l'impensable et de rendre possible l'impossible. Après plusieurs décennies dans les hautes sphères de la publicité, l'un des secteurs les plus concurrentiels au monde, Paul Arden traite ici de questions aussi diverses que les avantages du licenciement et l'intérêt d'avoir tort. Il apporte des réponses originales et logiques à des questions quotidiennes. Beaucoup peuvent apparaître comme des évidences, mais toutes les questions ont l'air simples quand on connaît la réponse... Que vous soyez jeune diplômé, travailleur indépendant ou directeur général, ce livre vous apportera une aide inestimable si vous avez l'ambition de réussir. [Source : 4e de couv.]",
